INSERT INTO `expert_views` (`id`, `expert_title`, `expert_image`, `expert_description`, `created_at`, `updated_at`) VALUES
(2, 'India\'s Aluminium Market', '/assets/expert_views/7221IMG-20220925-WA0072.jpg', '<p>With over 7% growth per annum, one of the highest in the world, the Indian aluminium market is booming. Even better, sectors that extensively use aluminium are themselves booming, ensuring that this sector stays firmly on the growth path for times to come. Fortunately for India, it is perched atop the 5th largest Bauxite reserves in the world, coupled with one of the world&#39;s lowest per capita consumption rates, which means India is in the perfect place to capitalise on this demand. In the backdrop of a robust economy and formidable growth rates of the Aluminium sector, this group will foster the exchange of ideas &amp; deliberations upon the latest technology, products and new business opportunities between Primary producers, Casters, Extruders, Recyclers, Equipment Suppliers, Technology developers, Traders, academics and other stake holders of the ALUMINIUM industry. Step into the dynamic Indian market and discover why the future of aluminium lies nowhere else but in India.</p>\r\n', '15-08-2022', '25-09-2022'),
(3, 'Aluminium .....a metal.....', '/assets/expert_views/7184IMG-20220925-WA0036.jpg', '<p><strong>What is the future of Aluminium industry?</strong></p>\r\n\r\n<p>A new report has revealed that&nbsp;<strong>global aluminium demand will increase by almost 40 per cent by 2030</strong>&nbsp;and that the aluminium sector will need to produce an additional 33.3 Mt to meet demand growth in all industrial sectors &ndash; from 86.2 Mt in 2020 to119. 5 Mt in 2030</p>\r\n\r\n<p><strong>Why is aluminium the future metal?</strong></p>\r\n\r\n<p>There are attributes to the metal that has made the world change from ferrous metals to aluminium.&nbsp;<strong>It is lightweight, doesn&#39;t corrode, is strong and durable, conducts heat and electricity, is flexible where needed and impermeable otherwise, and remains highly recyclable.</strong></p>\r\n\r\n<p><strong>Which sector is the largest consumer of aluminium in India?</strong></p>\r\n\r\n<p>The principal user segment of the aluminium industry in India continues to be the&nbsp;<strong>electrical and electronics</strong>&nbsp;sector followed by automotive, transportation, building, construction, packaging, consumer durables, industrial and defence</p>\r\n', '15-08-2022', '25-09-2022'),
(4, 'Adani Group plans to step up aluminium play, may go for production', '/assets/expert_views/5383IMG-20220925-WA0067.jpg', '<p>Billionaire Gautam Adani-led Adani Group last week came up with an investment proposal to the tune of Rs 41,653 crore for the&nbsp;<a href=\"https://www.timesnownews.com/topic/alumina-refinery\">alumina refinery</a>. However, the Ahmedabad-headquartered ports-to-power conglomerate has bigger plans than just setting up a mega&nbsp;<a href=\"https://www.timesnownews.com/topic/alumina\">alumina</a>refinery.</p>\r\n\r\n<p>If the ongoing discussions between the Adani Group and the&nbsp;<a href=\"https://www.timesnownews.com/topic/odisha\">Odisha</a>&nbsp;government are any hint, the conglomerate group is poised to explore the aluminium production opportunity, according to a report in&nbsp;<em>Business Standard</em>.</p>\r\n\r\n<p>On Thursday,&nbsp;<a href=\"https://www.timesnownews.com/topic/adani-enterprises\">Adani Enterprises</a>, the flagship company of Adani Group, got the approval of the Odisha government to set up two projects, including a 4 million tonnes per annum (mtpa) integrated alumina refinery. The group said these projects would generate 9,300 direct jobs.</p>\r\n\r\n<p>The financial daily quoted Hemant Sharma, Principal Secretary, Industries Department, Odisha, as saying that negotiations are on with the Adanis to forward integration into aluminium from alumina.</p>\r\n\r\n<p>&ldquo;Aluminium production is highly power-intensive and needs to be located close to coal and water resources. This will be at a different location,&rdquo; Sharma told the daily.</p>\r\n\r\n<p>The proposed investment of Rs 41,653 crore includes an alumina refinery of 4 mtpa and a 175- megawatt (MW) captive power plant.</p>\r\n\r\n<p>Alumina is used in the aluminium production process, and this alumina refinery will be set up near potential bauxite deposits or already operational mines, said a group statement issued earlier at the time of the announcement of the project. This will involve the production of smelter-grade (metallurgical grade) alumina, which will help India move towards creating import substitution.</p>\r\n\r\n<p>At present, India is a net importer of alumina, but the country can become a net exporter once the Adani refinery is set up. Hetal Gandhi, Director, Crisil Research, said total alumina capacity would be 12-13 MMPTA by 2027, against the domestic requirement of 10.5-11 MMPTA.</p>\r\n\r\n<p>&ldquo;With the foray of Adani Group into the alumina business, the surplus is expected to further widen by an incremental 4 MMPTA, leading to India becoming a net exporter of alumina,&rdquo; the publication quoted him as saying.</p>\r\n\r\n<p>The industry is dominated by only three players&mdash;Vedanta,&nbsp;<a href=\"https://www.timesnownews.com/topic/hindalco\">Hindalco</a>&nbsp;and state-owned Nalco.&nbsp;<a href=\"https://www.timesnownews.com/topic/vedanta\">Vedanta</a>&nbsp;at 2.27 MMTPA, Hindalco at 1.3 MMTPA, and Nalco at 460,000 tonnes.</p>\r\n', '18-08-2022', '25-09-2022'),
(5, 'Hindalco develops India\'s first all-aluminium railway wagon', '/assets/expert_views/7855IMG-20220925-WA0026.jpg', '<p>Hindalco Industries, the Aditya Birla Group metals flagship, has developed the country&#39;s first all-aluminium railway wagon that is 3.2 tons lighter than a steel rake.</p>\r\n\r\n<p>Speaking at Hindalco&#39;s annual general meeting on August 23, chairman Kumar Mangalam Birla termed the wagon, made from lightweight, high-strength aluminium alloys, a game-changer.</p>\r\n\r\n<p>The wagon will enable savings of 1,500 tons in carbon emissions a year. It will boost the logistics efficiency of coal transportation and also fast tracks India&#39;s decarbonisation journey, Birla said.</p>\r\n\r\n<p>&quot;Even if 5 percent of the 2 lakh railway wagons that the government plans to introduce are made of aluminium, potential CO2 savings will be in the region of 15 million tons per year,&rdquo; he said.</p>\r\n', '25-08-2022', '25-09-2022');
