(3, 'Premium Membership Yearly', 'Prime Membership', 15000, '12 Months + 1 month free trial', '<p>Special Launch offer of Rs.15000/ - plus GST for 12 months subscription plus one month trial membership free.For the verification of user&rsquo;s identity, eligibility etc. and for registration of the user and to provide customized services to the users and For facilitating the services offered/available on the Website and Mobile Application.</p>\r\n', 9, 9, 18, 1350, 1350, 2700, 17700, '30-05-2022', '02-09-2022');
INSERT INTO `products` (`id`, `product_name`, `product_image`, `product_description`, `created_at`, `updated_at`) VALUES
(1, 'Aluminium Roofing Sheets', '/assets/products/4097IMG-20221008-WA0006.jpg', '<p>Roofing sheets: Aluminium roofing / Corrugated sheets , bare aluminium, and colour coated aluminium available in different profiles mainly Circular, trapezoidal, long profile, brick pattern and other designs are available in various alloys namely 8011, 3105, 5052 etc and based on the specifications like thickness, profile design, pattern, width, length and also colour coated or plain/bare .Colours coating is as per RAL colour and material is provided in DC and CC route process.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '11-08-2022', '08-10-2022'),
(2, 'Aluminium Circles', '/assets/products/3093IMG-20220925-WA0010.jpg', '<p>Aluminium Circles &ndash; Round shape Aluminium Circles meant for Cookware use, available in CC and DC hot rolled type in various thickness, alloy, temper and specification as per customers requirements.</p>\r\n', '11-08-2022', '25-09-2022'),
(3, 'Aluminium Fins', '/assets/products/6622IMG-20220925-WA0070.jpg', '<p>Fins and AC fins- Aluminium fins are used for Air conditioning , Heat exchangers, Evaporators and condensers and are made in alloys mainly 8011, 1100, 1050, 1060 in multiple thickness, widths and temper as per specification.Material is provided in Bare and Hydrophilic coating blue and gold, as per requirements.</p>\r\n', '11-08-2022', '25-09-2022'),
(4, 'Hot Rolled Coil', '/assets/products/5189compressed_1660565252193.jpg', '<p>HOT ROLLED Jumbo Coils &ndash; for Re rolling .Available in various alloys , temper, thickness and widths as per customers requirements.Jumbo coils unit weight can be from 1.5 tonnes to 8 tonnes coil.</p>\r\n\r\n<p>&nbsp;HOT ROLLED Jumbo Coils &ndash; for Re rolling .Available in various alloys , temper, thickness and widths as per customers requirements.Jumbo coils unit weight can be from 1.5 tonnes to 8 tonnes coil.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '11-08-2022', '15-08-2022'),
(5, 'PP Cap Aluminium', '/assets/products/4230IMG-20220925-WA0006.jpg', '<p>Aluminium PP cap closure stock material consists of Aluminium sheets and coil for manufacturing of ROPP caps or closures or caps for bottles.These are available in various alloys, temper, thickness, custom made sizes and are suitable for long and short draw.Custom sizes, thickness and sheets sizes are made as per specifications and requirements of customer.</p>\r\n', '11-08-2022', '25-09-2022'),
(6, 'Aluminium Foils', '/assets/products/500IMG-20220925-WA0079.jpg', '<p>Aluminium Foils are available in multiple thickness , alloy, temper, packaging and for multiple or specialised usage.Plain foils, GEQ foils , House foil( packaging) , Containers foil, foils for lamination,Pharmaceutical foils, AC fins, Foils for insulation etc. .Foils are available in DC and CC route from manufacturers Re rollers , Importers and Convertors in various packaging and as per specification and customers requirements.</p>\r\n', '11-08-2022', '08-10-2022'),
(7, 'Aluminium Checkered Sheets', '/assets/products/8286IMG-20220925-WA0037.jpg', '<p>Aluminium Checkered/ Tread plate/&nbsp;&nbsp;Patterned/ Stucco/ Five Bar-small and Big design and Diamond pattern are available in DC and CC route as per alloy, thickness, temper, width, length and also as per various International and Indian standards.Standard sizes and custom made sizes available as per requirements</p>\r\n', '11-08-2022', '25-09-2022'),
(8, 'Aluminium Sheets', '/assets/products/4704IMG-20220925-WA0054.jpg', '<p>Aluminium Sheets are made in DC- Direct casting Hot Rolled process and CC- Caster Route &ndash; cold rolling.Sheets are available in various thickness ranging from 0.46 mm to 305 mm and in various widths and lengths.The standards sizes are 1220 x 2440 mm , 1000 x 2000, 2440 x 915, 1500 x 3050.Sheets are available as per various Indian and International standards like IS:737,EN , AS and JIS standards with various temper.Packings are standards and customs made and as a special case, BLUE PE fil, or paper interleafing or pallet packing etc are available on demand.Odd sizes and customised widths, lengths and thicknesses are available as per Order to manufacturer.</p>\r\n', '11-08-2022', '25-09-2022'),
(9, 'Aluminium Alloy Plates', '/assets/products/169compressed_1660564571998.jpg', '<p>Aluminium Plates are normally over and above thickness of 6.00 mm to 305 mm and are DC route or Hot Rolled made in various special alloys like 6061, 0682, 2014, 5052, 5083, 5754, 7075 etc.Standard sizes are 1250 x 2500 , 1500 x 3000 , 1525 x 3050, 1000 x 2000.Special sizes and cut sizes are catered as per availability and can be supplied as per EN, IS , AIS or JIS standards in various temper,special packing,Blue PE film or paper interleafing as per special request.Mill test Certificate( MTC) can be provided , if required.</p>\r\n', '15-08-2022', '15-08-2022'),
(10, 'Aluminium Foil Stock Coils', '/assets/products/2773compressed_1660564502049.jpg', '<p>Aluminium Foil stock is mainly CC or DC route coils meant for further re rolling in to various foils in various thicknesses.These coils are available in various alloys , temper, sizes, thickness, width and Jumbo coils as per customer requirements.Foil stocks are available in alloy like 8011, 8079, 1100, 1235, 3003 etc</p>\r\n', '15-08-2022', '15-08-2022'),
(11, 'Aluminium Coils', '/assets/products/1046coils.jpeg', '<p>Aluminium coils are made by various manufacturers in most of the alloys and with DC- Direct casting Hot Rolled process and CC &ndash; Caster route cold roll process.Coils are been produced in different thicknesses and width and temper, as per specification and multiple requirements for processing further.Coils can be supplied as per various standards like IS:737, EN, AS or JIS satndards as per requirements.Standards widths are 305 mm, 457 mm, 610 mm, 762 mm , 915 mm, 1000 mm , 1220 mm and 1500 mm .Custom made or odd size width are available as per Pre-Order.Common alloys are 1100, 1200, 1050, 1060, 1070, 8011, 3003, 5052 etc.Inner core id as per requirements with Unit coil weight.All material can be supplied as per required specification .</p>\r\n', '15-08-2022', '17-10-2022'),
(13, 'Aluminium Ingots EC', '/assets/products/7742IMG-20220925-WA0082.jpg', '<h2 style=\"font-style:italic\"><strong>Aluminium Ingots - EC and CG and Aluminium Alloy Ingots.........</strong></h2>\r\n\r\n<p><strong>EC Grade - IE07 / IE10 / IE 10 in 10 Kgs and 20 kgs.</strong></p>\r\n\r\n<p><strong>CG Grade - IC20 in 10 Kgs and 20 Kgs.</strong></p>\r\n\r\n<p><strong>Aluminium Alloy Ingots - LM4 , LM6, LM24, ALSI-132, ADC-12, LM-13 - 10 KGS INGOTS.</strong></p>\r\n', '25-09-2022', '22-10-2022'),
(14, 'Extrusions and Profiles', '/assets/products/5747IMG-20220925-WA0081.jpg', '<h2 style=\"font-style:italic\"><em><strong>Aluminium Extrusions and Profiles.....</strong></em></h2>\r\n', '25-09-2022', '22-10-2022'),
(15, 'Aluminium Wire Rod EC', '/assets/products/6917IMG-20220925-WA0071.jpg', '<h2 style=\"font-style:italic\"><strong>Aluminium Wire Rods........</strong></h2>\r\n\r\n<p><strong>EC GRADE - WIRE RODS </strong></p>\r\n\r\n<p><strong>ALLOY 1350 , 5005, 6101, 6201, 8017.</strong></p>\r\n\r\n<p><strong>THICKNESS - 7.6 MM , 9.5 MM , 11.95 MM , 12.5 MM .</strong></p>\r\n\r\n<p><strong>TEMPER - H-12, H-14 AND H-16 ( DRAWING STOCK ) .</strong></p>\r\n\r\n<p><strong>ALLOY WIRE RODS .</strong></p>\r\n\r\n<p><strong>3003 , 5052, 5056, 5154 , 6061 &amp; 6083.</strong></p>\r\n\r\n<p><strong>THICKNESS - 9.5 MM AND 12.7 MM .</strong></p>\r\n', '25-09-2022', '22-10-2022'),
(16, 'Containers Foils & House Foils', '/assets/products/9534IMG-20220925-WA0058.jpg', '<h2 style=\"font-style:italic\"><strong>Aluminium Containers Foils, House Foils.......</strong></h2>\r\n', '25-09-2022', '22-10-2022'),
(17, 'Aluminium Ingots CG', '/assets/products/1651AluminiumIngotsCG.jpg', '<h2><strong>Aluminium Ingots - EC and CG and Aluminium Alloy Ingots.........</strong></h2>\r\n\r\n<p><strong>EC Grade - IE07 / IE10 / IE 10 in 10 Kgs and 20 kgs.</strong></p>\r\n\r\n<p><strong>CG Grade - IC20 in 10 Kgs and 20 Kgs.</strong></p>\r\n\r\n<p><strong>Aluminium Alloy Ingots - LM4 , LM6, LM24, ALSI-132, ADC-12, LM-13 - 10 KGS INGOTS.</strong></p>\r\n', '14-10-2022', '22-10-2022'),
(18, 'Aluminium Alloy Wire Rod', '/assets/products/9666AluminiumAlloyWireRod.jpeg', '<h2><strong>Aluminium Wire Rods........</strong></h2>\r\n\r\n<p><strong>EC GRADE - WIRE RODS</strong></p>\r\n\r\n<p><strong>ALLOY 1350 , 5005, 6101, 6201, 8017.</strong></p>\r\n\r\n<p><strong>THICKNESS - 7.6 MM , 9.5 MM , 11.95 MM , 12.5 MM .</strong></p>\r\n\r\n<p><strong>TEMPER - H-12, H-14 AND H-16 ( DRAWING STOCK ) .</strong></p>\r\n\r\n<p><strong>ALLOY WIRE RODS .</strong></p>\r\n\r\n<p><strong>3003 , 5052, 5056, 5154 , 6061 &amp; 6083.</strong></p>\r\n\r\n<p><strong>THICKNESS - 9.5 MM AND 12.7 MM .</strong></p>\r\n', '14-10-2022', '22-10-2022'),
(19, 'Aluminium Alloy Ingots', '/assets/products/125aluminium-alloy-ingot-500x500.jpg', '<p><strong>Aluminium Alloy Ingots - LM4 , LM6, LM24, ALSI-132, ADC-12, LM-13 - 10 KGS INGOTS.</strong></p>\r\n', '09-12-2022', NULL);
