(1, 'sellerterm', 'Seller - Terms and conditions', '<p>PLEASE READ THESE TERMS CAREFULLY<br />\r\nThis agreement is a legal agreement between you (Seller or you) and Allmetalika Global Private Limited (hereinafter referred to as &lsquo;Allmetalika&rsquo; or &lsquo;Us&rsquo; or &lsquo;We&rsquo;) incorporated and registered in India. The terms of this agreement are in addition to the other Terms and Policies on the website and mobile application.&nbsp;</p>\r\n\r\n<p>1) INTERPRETATION<br />\r\n1.1 The definitions and rules of interpretation in this clause apply in this agreement.<br />\r\nAuthorised Users: those individuals authorised to use the Services.<br />\r\nUser/Seller Data: the data inputted by the Seller, Authorised Users, or the Allmetalika on the Seller&rsquo;s/Buyer&rsquo;s/Seller&#39;s/User&rsquo;s behalf for the purpose of using the Services or facilitating the use of the Services.<br />\r\nDocumentation: the documentation made available to the Seller which includes transactional documents such as Proforma Invoice and Purchase Order.&nbsp;<br />\r\nEffective Date: the date of this agreement.<br />\r\nInitial Subscription Term: Unless otherwise agreed between Allmetalika and Seller(s) on the Website or Mobile Application the term of the Subscription shall be 1 (One) Year .<br />\r\nRenewal Period: the period described in clause 11.1<br />\r\nServices: the subscription services, in respect of the Sellers on the Website and Mobile Application shall, provided by the Allmetalika to the Seller&rsquo;s under this agreement via the Website or Mobile Application as more particularly described herein below.<br />\r\nSoftware: the online software application provided by the Allmetalika on the Website and Mobile Application as the Services.<br />\r\nSubscription Fees: the subscription fees payable by the Seller to the Allmetalika for the User Subscriptions, as set out in our pricing and subscription information pages during sign up.<br />\r\nSubscription Term: the Initial Subscription Term together with any subsequent Renewal Periods.<br />\r\nSeller&rsquo;s Subscriptions: the user subscriptions purchased by the Seller&rsquo;s pursuant to clause 7.1 which entitle Authorised Seller&rsquo;s to access and use the Services and the Documentation in accordance with this agreement.<br />\r\nVirus: any thing or device (including any software, code, file or programme) which may: prevent, impair or otherwise adversely affect the operation of any computer software, hardware or network, any telecommunications service, equipment or network or any other service or device; prevent, impair or otherwise adversely affect access to or the operation of any programme or data, including the reliability of any programme or data (whether by re-arranging, altering or erasing the programme or data in whole or part or otherwise); or adversely affect the user experience, including worms, trojan horses, viruses and other similar things or devices.<br />\r\nWebsite: our website at https://www.allmetalika.com.<br />\r\n1.2 Clause and paragraph headings shall not affect the interpretation of this agreement.<br />\r\n1.3 A person includes an individual, corporate or unincorporated body (whether or not having separate legal personality).<br />\r\n1.4 A reference to a company shall include any company, corporation or other body corporate, wherever and however incorporated or established.<br />\r\n1.5 Unless the context otherwise requires, words in the singular shall include the plural and in the plural shall include the singular.<br />\r\n1.6 A reference to a statute or statutory provision is a reference to it as it is in force as at the date of this agreement.<br />\r\nThis clause sets out the meaning of certain words and terms used in the rest of the agreement.<br />\r\n&nbsp;<br />\r\n2) SELLER&rsquo;S SUBSCRIPTIONS<br />\r\n2.1 Subject to the Seller purchasing the Subscriptions and complying with the terms of this agreement and the Terms and Policies elsewhere on the Website and Mobile Application, Allmetalika hereby grants to the Seller a non-exclusive, non-transferable right to permit the Authorised Sellers to use the Services and the during the Subscription Term. Authorised Seller&rsquo; may use the Services to view the requirement of prospective buyers, submit online quote, get assistance in documentation and obtaining Buyer details, manager orders, complete the sales, .<br />\r\n2.2 In relation to the Authorised Sellers, the Seller undertakes that:<br />\r\na) that it shall only obtain one subscription and create one account per entity;<br />\r\nb) it will not allow or suffer any Subscription to be used by more than one individual Authorised Seller and&nbsp;<br />\r\nc) each Authorised User shall keep a secure password for their use of the Services, that such password shall be changed no less frequently than monthly and that each Authorised User shall keep their password confidential.<br />\r\nOnly authorised persons (the specific people you have paid for) can use the service and you won&rsquo;t let anyone else access your account.<br />\r\n2.3 The Seller shall not:<br />\r\na) except as may be allowed by any applicable law which is incapable of exclusion by agreement between the parties:<br />\r\ni) and except to the extent expressly permitted under this agreement, attempt to copy, modify, duplicate, create derivative works from, frame, mirror, republish, download, display, transmit, or distribute all or any portion of the Software and/or Documentation (as applicable) in any form or media or by any means; or<br />\r\nii) attempt to reverse compile, disassemble, reverse engineer or otherwise reduce to human-perceivable form all or any part of the Software; or<br />\r\nb) access all or any part of the Services and Documentation in order to build a product or service which competes with the Services and/or the Documentation; or<br />\r\nc) license, sell, rent, lease, transfer, assign, distribute, display, disclose, or otherwise commercially exploit, or otherwise make the Services and/or Documentation available to any third party except the Authorised Users; or<br />\r\nd) attempt to obtain, or assist third parties in obtaining, access to the Services and/or Documentation, other than as provided under this clause 2.<br />\r\n&nbsp;You won&#39;t try to access the source code or recreate our service.<br />\r\n2.4 The Seller shall use best endeavours to prevent any unauthorised access to, or use of, the Services and/or the Documentation and, in the event of any such unauthorised access or use, promptly notify the Allmetalika, if you think anyone else has accessed your account you shall immediately inform Allmetallika in writing to our email id.&nbsp;<br />\r\n&nbsp;<br />\r\n3) TERMS FOR SELLERS&nbsp;<br />\r\n3.1 Account : On payment of the Subscription Amount and filling in details required by us, the Sellers shall be able to create their account. This account shall be accessible by website and/or mobile application. The Seller agrees that Allmetalika shall carry out Seller&rsquo;s verification, on its own account and through means available to it,. Seller&rsquo;s account activation shall be subject to verification by Allmetalika, whether or not Seller has made any Subscription payment. Allmetalika may refuse registration to any Seller, at its discretion without assigning any reason.<br />\r\n3.2 After validly logging into the Seller&rsquo;s Account, Seller can check and/or edit its details like Business name, Person full name, address along with their Godown or Branch address, Phone number, Mobile number, Email id, GST, PAN and Bank details. These details shall be shared with the Buyer when the Buyer Accepts the Bid for any requirement listed by it. &nbsp;<br />\r\n3.3 After logging in the account on the website or mobile application, the Seller can visit the Bidding section to view the requirements posted by the prospective buyers.&nbsp;<br />\r\n3.4 The Sellers can view all the requirements posted by the prospective Buyers. The Buyers may post requirements in terms of the alloy, temper, standards, thickness, length, width, packing requirements, total requirement in KGS or pieces, delivery location, company make, other specifications and terms.&nbsp;<br />\r\n3.5 The Sellers in response to the Buyer&rsquo;s requirement may submit it&rsquo;s Bid (of products available with it) with details of price (price quoted is exclusive of CGST including door delivery transportation), delivery period, make of products, quantity, price validity, any other of its terms or any other details as required by the Buyer, etc.<br />\r\n3.6 If the Buyer Accepts the terms of the Seller&rsquo;s Bid, the system shall generate automated order confirmation form which shall include Buyer Entity details, goods description, quantity, price finalised, delivery period, delivery mode, address, GST and other statutory required details. On acceptance, the buyer shall make 20% advance payment to the seller directly through NEFT/RTGS for confirmation of order.&nbsp;<br />\r\n3.7 On receipt of the 20% advance payment, the Seller shall arrange for the dispatch of goods, make final tax invoice, upload the same on system as well as email it to the buyer. (Allmetalika is not liable or responsible for any terms agreed upon or not agreed upon between the parties and/or breach of terms by either party)<br />\r\n3.8 After Buyer makes the balance 80% payment against tax invoice and uploads the UTR number and payment details on the system, the seller shall dispatch the goods and provide the details of &lsquo;E-way Bill, Truck number, Lorry Receipt, details of the transporter, delivery challan, Mill Test Certificate of Manufacturer, Packing List and upload these on the system and through email to the buyer.<br />\r\n3.9 The Sale is completed once goods are delivered at agreed location and buyer issues Goods Receipt Note (GRN) or gives confirmation on the Website or mobile application.&nbsp;<br />\r\n3.10 The Sellers shall bid for products as available with them in stock, time period for delivery and the manner in which delivery shall be made must be clearly mentioned in the terms along with BID. The order, price or terms cannot not be changed or cancelled once the buyer has accepted the same. &nbsp;<br />\r\n3.11 All selling transactions on the Website or mobile Application are a firm commitment to sell. You are obligated to complete the transaction with the Buyer, once the Buyer has accepted the Seller&rsquo;s Bid, the Seller cannot cancel the order. You are under contractual obligation to supply the goods on receipt of advance payment. If the goods are not delivered as agreed. Allmetalika may assist the Buyer to initiate legal proceedings, whether criminal or civil as to the risk and consequences of the Seller. &nbsp;<br />\r\n3.12 The Seller shall be responsible for the overall quality and quantity of the products. At no time, Allmetalika takes title or ownership of any product or inventory.&nbsp;<br />\r\n3.13 You must ensure that the goods are authentic and confirm the requirements and specifications mentioned by the buyer.<br />\r\n3.16 If the item description does not match the actual condition of the item, you agree to refund any amounts that you may have received from the Buyer along with interest thereon and payment for damages whether liquidated or not. You shall be liable to refund the amount received by you or replace goods delivered by you or provide additional goods free of cost for reasons not restricted to (i) Product(s) / goods / merchandise being damaged; (ii) There being a manufacturing or inherent defect in the product delivered; (iii) Mismatch in the quantity of products supplied and quantity of products for which the order has been placed; and (iv) Product delivered is not the product for which the order has been placed.<br />\r\n3.18 You shall not create multiple bids/responses to a requirement from same or multiple account to create a false sense of multiple competitive bids.&nbsp;</p>\r\n\r\n<p>4) PRICE VARIATION CLAUSE&nbsp;<br />\r\n4.1 The price quoted by the Seller shall have price validity for three working days, starting on the day when Sellers gives it online price against a particular requirement placed by prospective buyer.&nbsp;<br />\r\n4.2 The Seller may revise its online price against a particular requirement placed by prospective buyer only after three working days, including the day of bidding</p>\r\n\r\n<p>4) ACCESS TO SERVICES<br />\r\n&nbsp;4.1 The Allmetalika shall, during the Subscription Term, provide the Services to the Seller on and subject to the terms of this agreement.&nbsp;<br />\r\n4.2The Allmetalika shall use commercially reasonable endeavours to make the Services available 24 hours a day, seven days a week, except for:<br />\r\na) planned maintenance carried out during the maintenance window&nbsp;<br />\r\nb) unscheduled maintenance provided that the Allmetalika has used reasonable endeavours to give the Seller notice in advance.<br />\r\nWe do our best to make sure you can access the service but there will be some occasions when it will be down (bug fixes, patches, updates etc.)<br />\r\n&nbsp;<br />\r\n5) SELLER DATA<br />\r\n5.1 The Seller shall own all right, title and interest in and to all of the Seller Data and shall have sole responsibility for the legality, reliability, integrity, accuracy and quality of the Seller Data.<br />\r\n5.2 The Allmetalika is not under any obligation to store any Seller Data. The Allmetalika shall not be responsible for any loss, destruction or alteration of Seller Data.<br />\r\n&nbsp;5.3 If the Allmetalika processes any personal data on the Seller&#39;s behalf when performing its obligations under this agreement, the parties record their intention that the Seller shall be the data controller and the Allmetalika shall be a data processor and in any such case:<br />\r\na) the Seller acknowledges and agrees that the personal data may be transferred or stored outside the India or the country where the Seller and the Authorised Users are located in order to carry out the Services and the Allmetalika&#39;s other obligations under this agreement;<br />\r\nb) the Seller shall ensure that the Seller is entitled to transfer the relevant data (whether personal or not) to the Allmetalika so that the Allmetalika may lawfully use, process and transfer the data in accordance with this agreement on the Seller&#39;s behalf;<br />\r\nc) the Seller shall ensure that the relevant third parties have been informed of, and have given their consent to, such use, processing, and transfer as required by all applicable data protection legislation;<br />\r\nd) Allmetalika uses 256 bit encryption to safeguard all the data and transactional data on our data for security. However, each party shall take appropriate technical and organisational measures against unauthorised or unlawful processing of the data or its accidental loss, destruction or damage. Any information you put into our site belongs to you and not us<br />\r\nThe data will travel through third party servers to be processed and this means it could be processed by a server outside India. You are responsible for any Data Protection rules that apply to any content you upload.<br />\r\n&nbsp;<br />\r\n6) ALLMETALIKA&#39;S OBLIGATIONS<br />\r\n&nbsp;6.1 The Allmetalika undertakes that the Services will be performed substantially in accordance with the Terms and with reasonable skill and care.<br />\r\n6.2 The Allmetalika:<br />\r\na) does not warrant that the Seller&#39;s use of the Services will be uninterrupted or error-free; or that the Services, Documentation and/or the information obtained by the Seller through the Services will meet the Seller&#39;s requirements; and<br />\r\nb) is not responsible for any delays, delivery failures, or any other loss or damage resulting from the transfer of data over communications networks and facilities, including the internet, and the Seller acknowledges that the Services and Documentation may be subject to limitations, delays and other problems inherent in the use of such communications facilities.<br />\r\n&nbsp;We do our best to make sure our service does what it should, but we do not guarantee it.</p>\r\n\r\n<p>7) CHARGES AND PAYMENT<br />\r\n7.1 The Seller shall pay the Subscription Fees to the Allmetalika for the User Subscriptions in accordance with this clause 7.<br />\r\n7.2 The Seller shall pay the Subscription Fees to the Allmetalika for the User Subscriptions Annually in advance; or<br />\r\n7.3 The Seller shall pay the Subscription Fees by debit or credit card or Online or UPI through the Website or Mobile Application. Allmetalika uses the third party payment processors or gateways for payments. The Allmetalika does not store or process any card or bank details on its own servers.<br />\r\nProcessor or Gateway will store the card or bank details used to pay the Subscription Fees and will use those same card or bank details to automatically take payment for any Subscription Fees in respect of each Renewal Period.<br />\r\n7.4 All amounts and fees stated or referred to in this agreement:<br />\r\na) shall be payable in Indian Rupees;<br />\r\nb) are, subject to clause 10.4(b), non-cancellable and non-refundable;<br />\r\nc) are exclusive of any applicable taxes (such as GST), which shall be added to the Allmetalika&#39;s invoice(s) at the appropriate rate.<br />\r\n7.5 Allmetalika shall be entitled to increase the Subscription Fees at the start of each Renewal Period without prior notice to the Seller. You need to pay the subscription fees in advance through our website or mobile application.</p>\r\n\r\n<p>8) PROPRIETARY RIGHTS<br />\r\n&nbsp;8.1The Seller acknowledges and agrees that the Allmetalika and/or its licensors own all intellectual property rights in the Services. Except as expressly stated herein, this agreement does not grant the Seller any rights to, or in, patents, copyright, database right, trade secrets, trade names, trade marks (whether registered or unregistered), or any other rights or licences in respect of the Services.<br />\r\n8.2 Allmetalika confirms that it has all the rights in relation to the Services that are necessary to grant all the rights it purports to grant under, and in accordance with, the terms of this agreement. We own all intellectual property rights in our code/software/service.<br />\r\n8.3 Allmetalika does not own or claim any right in any Seller Data.</p>\r\n\r\n<p>9) INDEMNITY<br />\r\nYou own all rights in any data you upload, we do not claim any right over it, we just use it for the purpose of providing services. Seller shall indemnify Allmetalika, its agents, employees, directors, officers and affiliates from all refunds or warranties, claims, demands, liabilities, losses and damages (actual and consequential) of every kind and nature, known and unknown, suspected and unsuspected, disclosed and undisclosed, arising out of or in any way connected with listings or bid, accepted or unaccepted, completed or incomplete transactions, or goods offered or actually delivered.<br />\r\n9.1 The Seller shall defend, indemnify and hold harmless the Allmetalika against claims, actions, proceedings, losses, damages, expenses and costs (including without limitation court costs and reasonable legal fees) arising out of or in connection with the Seller&#39;s use of the Services or otherwise. &nbsp;If you do anything through our website which ends up with a legal claim being made against us you will be responsible for any damage or loss or costs or claim we incur as a result.<br />\r\n&nbsp;<br />\r\n10) LIMITATION OF LIABILITY<br />\r\n10.1 This clause 10 sets out the entire financial liability of the Allmetalika (including any liability for the acts or omissions of its employees, agents and sub-contractors or any person associated with it) to the Seller:<br />\r\na) arising under or in connection with this agreement;<br />\r\nb) in respect of any use made by the Seller of the Services; and<br />\r\nc) in respect of any representation, statement or tortious act or omission (including negligence) arising under or in connection with this agreement.<br />\r\n10.2 Except as expressly and specifically provided in this agreement:<br />\r\na) the Seller assumes sole responsibility for and from the use of the Services and the transactions (whether completed or not) entered into by the Seller, and for liability or loss arising therefrom. The Allmetalika shall have no liability for any damage caused by errors or omissions in any information, instructions or documentation provided to the Allmetalika by the Seller or Buyer in connection with the Services, or any actions taken by the Allmetalika at the Seller&#39;s direction or consent or due to use of services by Seller (including partial use of any service);<br />\r\nb) all warranties, representations, conditions and all other terms of any kind whatsoever implied by statute or common law are, to the fullest extent permitted by applicable law, excluded from this agreement; and<br />\r\nc) the Services are provided to the Seller on an &quot;as is&quot; basis.<br />\r\n10.3 Allmetalika is not liable and responsible to Seller or any other person for any action or inaction of a Buyer or any person posing to be a buyer or any other person.&nbsp;<br />\r\n10.4 Subject to clause 10.2 and clause 10.3:<br />\r\na) the Allmetalika shall not be liable whether in tort (including for negligence or breach of statutory duty), contract, misrepresentation, restitution or otherwise for any loss of profits, loss of business, depletion of goodwill and/or similar losses or loss or corruption of data or information, or pure economic loss, or for any special, indirect or consequential loss, costs, damages, charges or expenses however arising under this agreement; and<br />\r\nb) the Allmetalika&#39;s total aggregate liability in contract, tort (including negligence or breach of statutory duty), misrepresentation, restitution or otherwise, arising in connection with the performance or contemplated performance of this agreement shall be limited to the total Subscription Fees paid for the Subscriptions during the 12 months immediately preceding the date on which the claim arose.<br />\r\nWe will never be liable to you for anything more than your most recent subscription fee.<br />\r\n&nbsp;<br />\r\n11) TERM AND TERMINATION<br />\r\n11.1 This agreement shall, unless otherwise terminated as provided in this clause 11, commence on the Effective Date and shall continue for the Initial Subscription Term and, thereafter, this agreement shall be automatically renewed for successive periods equal in length to the Initial Subscription Term (each a Renewal Period), unless:<br />\r\na) either party notifies the other party of termination, in writing, at least 7 days before the end of the Initial Subscription Term or any Renewal Period, in which case this agreement shall terminate upon the expiry of the applicable Initial Subscription Term or Renewal Period; or<br />\r\nb) you cancel your subscription through our website; or<br />\r\nc) otherwise terminated in accordance with the provisions of this agreement;<br />\r\nand the Initial Subscription Term together with any subsequent Renewal Periods shall constitute the Subscription Term.<br />\r\nThis agreement lasts for Annual period. It will renew automatically at the end of each period on receipt of payment by us of then prevailing Subscription amount or until you cancel it.&nbsp;<br />\r\n&nbsp;11.2 Without affecting any other right or remedy available to it, Allmetalika may terminate this agreement with immediate effect by giving written notice to the Seller party if:<br />\r\na) the Sellers fails to pay any amount due to any person who has also availed of or is using or has used the Services of the Allmetalika;<br />\r\nb) the Seller party commits a material breach of any term agreed with Allmetalika or any person who has also availed of or is using or has used the Services of the Allmetalika;<br />\r\nc) the Seller has committed any acts which Allmetalika holds to be unethical or unfair trade practice or involves moral turpitude or fraudulent or bogus and/or provided any information which is false. The decision of Allmetalika in this regard shall be final.<br />\r\n11.3 On termination of this agreement for any reason:<br />\r\na) all licences granted under this agreement shall immediately terminate;<br />\r\nb) the Allmetalika may destroy or otherwise dispose of any of the Seller Data in its possession;&nbsp;<br />\r\nc) in case of termination under clause 11.2 c) Allmetalika shall have the right to not allow such entity or person whose subscription is so terminated or any of it&rsquo;s related party to take another Subscription and/or terminate their existing subscription including displaying names of such person on the website and mobile application and reason for termination of their subscriptions; and&nbsp;<br />\r\nd) any rights, remedies, obligations or liabilities of the parties that have accrued up to the date of termination, including the right to claim damages in respect of any breach of the agreement which existed at or before the date of termination shall not be affected or prejudiced.<br />\r\n&nbsp;&nbsp;<br />\r\n12 FORCE MAJEURE<br />\r\n&nbsp;The Allmetalika shall have no liability to the Seller under this agreement if it is prevented from or delayed in performing its obligations under this agreement, or from carrying on its business, by acts, events, omissions or accidents beyond its reasonable control, including, without limitation, strikes, lock-outs or other industrial disputes (whether involving the workforce of the Allmetalika or any other party), pandemic, failure of a utility service or transport or telecommunications network, act of God, war, riot, civil commotion, malicious damage, compliance with any law or governmental order, rule, regulation or direction, accident, breakdown of plant or machinery, fire, flood, storm or default of Allmetalikas or sub-contractors or vendors<br />\r\n&nbsp;We are not responsible for anything outside our control (power cuts, natural disasters, server downtimes etc.)</p>\r\n\r\n<p>13 ASSIGNMENT<br />\r\n13.1 The Allmetalika may but the Seller may not at any time assign, transfer, charge, sub-contract or deal in any other manner with all or any of its rights or obligations under this agreement.&nbsp; You can&rsquo;t transfer your account to someone else without our agreement.</p>\r\n\r\n<p>14 INDEPENDENT PARTIES<br />\r\nNothing in this agreement is intended to or shall operate to create a partnership between the parties, or authorise either party to act as agent for the other, and neither party shall have the authority to act in the name or on behalf of or otherwise to bind the other in any way (including, but not limited to, the making of any representation or warranty, the assumption of any obligation or liability and the exercise of any right or power). There is no agency, partnership, joint venture, employee-employer or franchisor-franchisee relationship between Allmetalika and any User of the Platform or between Allmetalika and any Seller or Buyer on the Platform.</p>\r\n\r\n<p>15 GOVERNING LAW<br />\r\nThis agreement and any dispute or claim arising out of or in connection with it or its subject matter or formation (including non-contractual disputes or claims) shall be governed by and construed in accordance with the law of India. Each party irrevocably agrees that the courts of Mumbai, Maharashtra shall have exclusive jurisdiction to settle any dispute or claim arising out of or in connection with this agreement or its subject matter or formation (including non-contractual disputes or claims).</p>\r\n', '30-05-2022', '12-08-2022'),
(2, 'aboutUs', 'About Us', '<p>ALLMETALIKA is the brainchild of Yash Jain, an aluminium industry veteran with a collective experience of more than 25 years working with reputed aluminium manufacturers and dealing in all types of aluminium products.<br />\r\nDuring the pandemic, businesses chose to function online when physical interaction paused.The need to unite the buyers and sellers on one online platform was the need of the hour. With that aim, ALLMETALIKA took shape. India&#39;s first mobile-based app cum website will bring all aluminium product sellers and buyers together, surpassing the physical boundaries across India.With this app, we are ushering into a new era in the world of Aluminium. Here, all large,medium, and small size manufacturers, traders, stockists, importers, indentors and wholesalers<br />\r\nwill be on boarded and the buyers will be provided with the best possible products, services,quality and most competitive prices.<br />\r\nWith this app, innumerable opportunities will unfold for the buyers and sellers of various aluminium products.<br />\r\nWelcome onboard ALLMETALIKA - all about aluminium.</p>\r\n', '30-05-2022', '16-08-2022');
INSERT INTO `service_settings` (`id`, `serviceName`, `title`, `descriptions`, `created_at`, `updated_at`) VALUES
(3, 'termsandConditions', 'Terms and Conditions', '<p><strong>TERMS AND CONDITIONS</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Allmetalika is an online site/application (web and mobile based), operated by &lsquo;Allmetalika Global Private Limited&rsquo;, to bring all buyers and sellers on platform for facilitating all India sales and supplies of all types of aluminium products (hereinafter referred to as &lsquo;us&rsquo;, &lsquo;we&rsquo;, &lsquo;our&rsquo;). The portal provides E-Commerce platform as well as lead generation and vendor development for sellers and buyers dealing in or looking to sell or purchase Aluminium products through web based applications, mobile applications.</p>\r\n\r\n<p>The Use (which shall mean and include access, use, visit, browse, download from, upload to, utilize but not restricted to these) of the portal (which shall include website or web- based application or mobile application or any feature or component or part or page or section of these by whatever name called) shall be governed by these Terms and Conditions. If you choose to use the portal in any manner you shall be accepting the Terms and Conditions. And your use shall be governed by these Terms and Conditions and other policies elsewhere on website every time you visit the portal, when you make registration, upon providing any information on portal and using the portal in any manner. By way of theseTerms and Conditions you are contracting with Allmetalika Global Private Limited, which expression unless the context otherwise require shall mean and include its successors, liquidators and assigns.</p>\r\n\r\n<p>For the purpose of theseTerms and Conditions, the word &lsquo;You&rsquo;, &lsquo;User&rsquo;, &lsquo;Seller&rsquo;, &lsquo;Buyer&rsquo; shall include any legal or natural person who uses the portal. To use the portal, you need to accept the Terms and Conditions herein, or as these amended from time to time by us. By choosing the &lsquo;I agree&rsquo; option on the Home Page or &lsquo;Start&rsquo; button or logging in through third party website or any other website as permitted by us you are accepting the Terms and Conditions contained herein. If you do not accept the Terms and Conditions herein do not click on &lsquo;I agree&rsquo; or button or login through third party web site and/or use the portal or otherwise access the portal.</p>\r\n\r\n<p>We reserve the right to amend the Terms and Conditions at our discretion. We may post revised version of the Terms and Conditions on the portal. Unless expressed otherwise the Terms and Conditions or any part of it shall become effective from the time it is posted on the portal. You are advised to regularly check for amendments, if any, to the Terms and Conditions. We may inform the registered users of any amendment of Terms and Conditionsthrough users&rsquo; registered email or by notification in the user accountsor by displaying it on the website. You may inform of your non-acceptance in the manner provided in time bound manner after which it will be understood that you have accepted the Terms and Conditions.</p>\r\n\r\n<p>Certain times we may provide services or run promotional offers which may be subject to additional terms and conditions. The user will have to accept these terms before use of such services or offers. To the extent where it relates to the additional services or offers, the additional terms and conditions shall prevail if inconsistent with these Terms and Conditions contained herein.</p>\r\n\r\n<p>At the outset we hereby disclose that we hold absolute rights and discretion to the following:</p>\r\n\r\n<ol>\r\n	<li>Make rules or system regarding the activities on the portal, change or modify the rules at any time without giving prior notice thereof;</li>\r\n	<li>Discontinue or modify or add or delete, permanently or temporarily any of the services or products on the portal, the portal itself or any part of the portal or any of the services provided by us on the portal or 