ne account on portal. Hence, user shall operate only one account across multiple email ids or Third party Site. For sake of clarity, if a user has more than one email account or more than one account on third party website, the user will create, operate or register account using only one of these and no further account(s) to be created, operated or registered using other email ids and other third party website.</li>\r\n	<li>You shall not engage in advertising to, or solicitation of, other Users of the portal to buy or sell any products or services, You may not transmit any chain letters or unsolicited commercial or junk email to other Users via the portal. It shall be a violation of these Terms and Conditions to use any information obtained from the portal in order to harass, abuse, or harm another person, or to contact, advertise to, solicit, or sell to another person. In order to protect Our Users from such advertising or solicitation, We reserve the right to restrict the access of any user to the portal including the user&rsquo;s account and take any action as We deem appropriate in our sole discretion. You understand that We have the right at all times to disclose any information (including the identity of the persons providing information or materials on the portal) as necessary to satisfy any law, regulation or valid governmental request. This may include, without limitation, disclosure of the information in connection with investigation of alleged illegal activity or solicitation of illegal activity or in response to a lawful court order or subpoena. In addition, We can (and You hereby expressly authorize Us to) disclose any information about You to law enforcement or other government officials, as we, in Our sole discretion, believe necessary or appropriate in connection with the investigation and/or resolution of possible crimes, especially those that may involve personal injury.</li>\r\n	<li>We reserve the right, but have no obligation, to monitor the materials posted on the portal. We shall have the right to remove or edit any content that in its sole discretion violates, or is alleged to violate, any applicable law or either the spirit or letter of these Terms and Conditions. Notwithstanding this right, YOU REMAIN SOLELY RESPONSIBLE FOR THE CONTENT OF THE MATERIALS YOU POST ON THE WEBSITE AND IN YOUR PRIVATE MESSAGES. Please be advised that such Content posted does not necessarily reflect our views. In no event shall we assume or have any responsibility or liability for any Content posted or for any claims, damages or losses resulting from use of Content and/or appearance of Content on the Portal. You hereby represent and warrant that You have all necessary rights in and to all Content which You provide and all information it contains and that such Content shall not infringe any proprietary or other rights of third parties or contain any libellous, tortious, or otherwise unlawful information.</li>\r\n	<li>You agree to receive all communication from us including emails, notifications, messages to your registered email, account on portal, account on SNS sites(s), registered mobile number or any other mobile number entered by You on the portal.</li>\r\n	<li>Users are themselves responsible for the maintaining confidentiality and secrecy of the user&rsquo;s information, account, account details, password. User shall not knowingly or unknowingly disclose or reveal these to any other person and take necessary precautions. The user shall log out from their account and portal after every use.We are not responsible for any breach of security or any loss or any damage caused to the user or any other person. User must inform us immediately about unauthorized use of their account, password or breach of security.</li>\r\n	<li>Your correspondence or business dealings with, or participation in promotions of, advertisers found on or through the portal, including payment and delivery of related products or services, and any other terms, conditions, warranties or representations associated with such dealings, are solely between You and such advertiser. We shall not be responsible or liable for any loss or damage of any sort incurred as the result of any such dealings or as the result of the presence of such advertisers on the portal.</li>\r\n	<li>It is possible that other users (including unauthorized users or &quot;hackers&quot;) may post or transmit offensive or obscene materials on the portal and that You may be involuntarily exposed to such offensive and obscene materials. It is also possible for others to obtain personal information about You due to your use of the portal, and that the recipient may use such information to harass or injure You. We do not approve of such unauthorized use, but by using the portal You acknowledge and agree that We are not responsible for the use of any personal information that You publicly disclose or share with others on the portal. Please carefully select the type of information that You publicly disclose or share with others on the portal.</li>\r\n	<li>We shall have all the rights to take necessary action and claim damages that may occur due to your involvement/participation in any way on your own or through group/s of people, intentionally or unintentionally in DoS/DDoS (Distributed Denial of Services).</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; LEGAL</strong></p>\r\n\r\n<ol>\r\n	<li>If it comes to the notice of Allmetalika that any governmental, statutory or regulatory compliances or approvals are required for any service or if it comes to the notice of Allmetalika that operating of portal is prohibited, then Allmetalika shall withdraw and / or cancel such service or portal or part thereof without prior notice to any users, Users agree not to make any claim in respect of such cancellation or withdrawal of service, or any amendments to the portal or part thereof in any manner.</li>\r\n	<li>The courts of competent jurisdiction at Mumbai shall have exclusive jurisdiction to determine any and all disputes arising out of, or in connection with, the Allmetalika Services provided by Allmetalika,the construction, validity, interpretation and enforceability of these Terms and Conditions, or the rights and obligations of the User(s) (including Buyers &amp; Sellers) or Allmetalika , as well as the exclusive jurisdiction to grant interim or preliminary relief in case of any dispute referred to arbitration as given below. All such issues and questions shall be governed and construed in accordance with the laws of the Republic of India.</li>\r\n	<li>In the event of any legal dispute (which may be a legal issue or question) which may arise between the Buyer and Seller, the party raising the dispute shall provide a written notification (&quot;Notification&quot;) to the other party. On receipt of Notification, the parties shall first try to resolve the dispute through discussions. In the event that the parties are unable to resolve the dispute within fifteen (15) days of receipt of Notification, the dispute shall be settled by arbitration. Almetallika shall not responsible for or involved in any legal disputes arising between the Users.</li>\r\n	<li>In respect of the disputes between Allmetalika and user. The place of arbitration shall be Mumbai, India. All arbitration proceedings shall be conducted in English and in accordance with the provisions of the Arbitration and Conciliation Act, 1996, as amended from time to time.</li>\r\n	<li>The arbitration award will be final and binding on the Parties, and each Party will bear its own costs of arbitration and equally share the fees of the arbitrator unless the arbitral tribunal decides otherwise. The arbitrator shall be entitled to pass interim orders and awards, including the orders for specific performance and such orders would be enforceable in competent courts. The arbitrator shall give a reasoned award.</li>\r\n	<li>Nothing contained in these Terms and Conditions shall prevent Allmetalika from seeking and obtaining interim or permanent equitable or injunctive relief, or any other relief available to safeguard Allmetalika&#39;s interest prior to, during or following the filing of arbitration proceedings or pending the execution of a decision or award in connection with any arbitration proceedings from any court having jurisdiction to grant the same. The pursuit of equitable or injunctive relief shall not constitute a waiver on the part of Allmetalika to pursue any remedy for monetary damages through the arbitration described herein.</li>\r\n</ol>\r\n\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; OTHER GENERAL CONDITIONS</strong></p>\r\n\r\n<ol>\r\n	<li>Users shall access the Allmetalika Services provided on Allmetalika voluntarily and at their own risk. Allmetalika shall, under no circumstances be held responsible or liable on account of any loss or damage sustained (including but not limited to any accident, injury, death, loss of property) by Users or any other person or entity during the course of access to the Allmetalika Services</li>\r\n	<li>By entering the Allmetalika and accessing the Allmetalika Services provided therein, Users hereby release from and agree to indemnify Allmetalika , and/ or any of its directors, employees, partners, associates and licensors, from and against all liability, cost, loss or expense arising out their access to the Allmetalika Services including (but not limited to) personal injury and damage to property and whether direct, indirect, consequential, foreseeable, due to some negligent act or omission on their part, or otherwise.</li>\r\n	<li>Allmetalika accepts no liability, whether jointly or severally, for any errors or omissions, whether on behalf of itself or third parties.</li>\r\n	<li>Users shall be solely responsible for any consequences which may arise due to their access of Allmetalika Services by conducting an illegal act or due to non-conformity with these Terms and Conditions and other rules and regulations in relation to Allmetalika Services, including provision of incorrect address or other personal details. Users also undertake to indemnify Allmetalika and their respective officers, directors, employees and agents on the happening of such an event (including without limitation cost of attorney, legal charges etc.) on full indemnity basis for any loss/damage suffered by Allmetalika on account of such act on the part of the Users.</li>\r\n	<li>Users shall indemnify, defend, and hold Allmetalika harmless from any third party/entity/organization claims arising from or related to such User&#39;s engagement with the Allmetalika or participation in any transaction. In no event shall Allmetalika be liable to any User for acts or omissions arising out of or related to User&#39;s engagement with the Allmetalika or his/her participation in any Transaction.</li>\r\n	<li>The liability of the Allmetalika in any case towards the user or any third party shall be restricted to Rs. 100 (Rupees One Hundred only)</li>\r\n	<li>In consideration of Allmetalika allowing Users to access the Allmetalika Services hosted on the portal, to the maximum extent permitted by law, the Users waive and release each and every right or claim, all actions, causes of actions (present or future) each of them has or may have against Allmetalika, its respective agents, directors, officers, business associates, group companies, sponsors, employees, or representatives for all and any injuries, accidents, or mishaps (whether known or unknown) or (whether anticipated or unanticipated) arising out of the provision of Allmetalika Services.</li>\r\n	<li>Neither Allmetalika nor its parent/holding company, subsidiaries, affiliates, directors, officers, professional advisors, employees shall be responsible for the deletion, the failure to store, the mis-delivery, or the untimely delivery of any information or material.</li>\r\n	<li>Allmetalika shall not be responsible for any harm resulting from downloading or accessing any information or material, the quality of servers, products, Allmetalika services or sites, cancellation of order. Allmetalika disclaims any responsibility for, and if a User pays for access to one of Allmetalika &#39;s Services the User will not be entitled to a refund as a result of, any inaccessibility that is caused by Allmetalika &#39;s maintenance on the servers or the technology that underlies our sites, failures of Allmetalika &#39;s service providers (including telecommunications, hosting, and power providers), computer viruses, natural disasters or other destruction or damage of our facilities, acts of nature, war, civil disturbance, or any other cause beyond our reasonable control. In addition, Allmetalika does not provide any warranty as to the content on the Allmetalika (s). Allmetalika (s) content is distributed on an &quot;as is, as available&quot; basis.</li>\r\n	<li>Any material accessed, downloaded or otherwise obtained through Allmetalika is done at the User&#39;s discretion, competence, acceptance and risk, and the User will be solely responsible for any potential damage to User&#39;s computer system or loss of data that results from a User&#39;s download of any such material.</li>\r\n	<li>Allmetalika shall make best endeavours to ensure that the Allmetalika (s) is error-free and secure, however, neither Allmetalika nor any of its partners, licensors or associates makes any warranty that:the Allmetalika (s) will meet Users&#39; requirements, that Portal and the services(s) will be uninterrupted, timely, secure, or error free; that the results that may be obtained from the use of Portal(s) will be accurate or reliable; andthe quality of any products, Allmetalika Services, information, or other material that Users purchase or obtain through Portal will meet Users&#39; expectations.</li>\r\n	<li>In case Allmetalika discovers any error, Allmetalika reserves the right (execisable at its discretion) to rectify the error in such manner as it deems fit, including through a debit or adjustments by whatever name called of the erroneous payment from amounts due to the User or deduction from the User&#39;s account of the amount of erroneous payment.In case of exercise of remedies in accordance with this clause, Allmetalika agrees to notify the User of the error and of the exercise of the remedy(ies) to rectify the same.</li>\r\n	<li>Allmetalika nor its partners, licensors or associates shall be liable for any direct, indirect, incidental, special, or consequential damages arising out of the use of or inability to use our sites, even if we have been advised of the possibility of such damages.</li>\r\n	<li>Any Allmetalika Services, events being hosted or provided, or intended to be hosted or provided by Allmetalika and requiring specific permission or authority from any statutory authority or any state or the central government, or the board of directors shall be deemed cancelled or terminated, if such permission or authority is either not obtained or denied either before or after the availability of the relevant Allmetalika Services.</li>\r\n	<li>To the extent permitted under law, in the event of suspension or closure of any Services, or portal or part thereof or any other user. Users (including Participants) shall not be entitled to make any demands, claims, of any nature whatsoever.</li>\r\n	<li>Allmetalika may be required under certain legislations, to notify User(s) of certain events. User(s) hereby acknowledge and consent that such notices will be effective upon Allmetalika posting them on the Allmetalika or delivering them to the User through in-app notification or through the email address provided by the User at the time of registration. User(s) may update their email address by logging into their account on the Allmetalika. If they do not provide Allmetalika with accurate information, Allmetalika cannot be held liable for failure to notify the User.</li>\r\n	<li>Allmetalika shall not be liable for any delay or failure to perform resulting from causes outside its reasonable control, including but not limited to any failure to perform due to unforeseen circumstances or cause beyond Allmetalika &#39;s control such as acts of God, war, terrorism, riots, embargoes, acts of civil or military authorities, fire, floods, accidents, network infrastructure failures, pandemic, strikes, or shortages of transportation facilities, fuel, energy, labor or materials or any cancellation by buyer or seller or their vendor/supplier. In such circumstances, Allmetalika shall also be entitled to cancel any service without any further disclosures and without any liability.</li>\r\n	<li>If any part of these Terms and Conditions is determined to be indefinite, invalid, or otherwise unenforceable, the rest of these Terms and Conditions shall continue in full force.</li>\r\n	<li>If any part of these Terms and Conditions or the application thereof is held invalid, the invalidity shall not affect other provisions or applications of the Agreement which can be given effect without the invalid provisions or applications and to this end the provisions of these Terms and Conditions are declared to be severable and shall not affect the validity and enforceability of remaining Terms and Conditions.</li>\r\n	<li>Allmetalika &#39;s failure to exercise or enforce any right or provision of these Terms and Conditions shall not constitute a waiver of such right or provision. If you breach these conditions and we take no action, we will still be entitled to use our rights and remedies in any situation where you breach these conditions.</li>\r\n	<li>Users agree that regardless of any statute or law to the contrary, any claim or cause of action arising out of or related to use of the Allmetalika or these Terms and Conditions must be filed within thirty (30) days of such claim or cause of action arising or be forever barred.</li>\r\n	<li>These Terms and Conditions, including all terms, conditions, and policies that are incorporated herein by reference, constitute the entire agreement between the User(s) and Allmetalika and govern your use of the Portal, superseding any prior agreements that any User may have with Allmetalika .</li>\r\n	<li>Allmetalika reserves the right to moderate, restrict or ban the use of the Allmetalika , specifically to any User, or generally, in accordance with Allmetalika &#39;s policy/policies from time to time, at its sole and absolute discretion and without any notice.</li>\r\n	<li>Allmetalika may, at its sole and absolute discretion, permanently close or temporarily suspend any Allmetalika Services.</li>\r\n</ol>\r\n\r\n<ol>\r\n	<li>Participation in any Promotion will be subject to a user complying with the Promotion Terms implemented by Allmetalika in respect of such Promotion (&ldquo;Promotion Terms&rdquo;) and these Terms and Conditions. By participating in any Promotion, the participant further consents to and agrees to adhere with the Terms and Conditions of the Allmetalika portal &nbsp;and Allmetalika &rsquo;s Privacy Policy.</li>\r\n	<li>The Promotions are only open to users in India. Participation in the Promotions by proxy is not permitted.</li>\r\n	<li>Participation in the Promotions is voluntary.</li>\r\n	<li>Participation in one Promotion does not guarantee that such user will be eligible to participate in another Promotion.</li>\r\n	<li>A user may participate in a Promotion and avail of each Promotion only through one account. An existing user of Allmetalika shall not register a new account or operate more than one user account with Allmetalika or participate in a Promotion by registering a new account.</li>\r\n	<li>Users intending to participate in a Promotion may be required to verify their mobile number and other account details in accordance with the Promotion Terms for such Promotion.</li>\r\n	<li>Persons intending to participate in a Promotion, who have listed their phone numbers on the National Do Not Call Registry (&ldquo;NDNC Registry&rdquo;), shall de-register themselves from the NDNC Registry till the completion of such Promotion. Such persons agree not to make any claim or raise any complaint whatsoever against Allmetalika in this respect. Please note that persons intending to participate in a Promotion who have not de-registered themselves from the NDNC Registry shall also have no right to make any claim or raise any complaints against Allmetalika if they do or do not receive any call or SMS with respect to their participation and all other matters pertaining to a Promotion.</li>\r\n	<li>The verification process may require you to submit personal information about yourself. You agree to receive communication from Allmetalika. Any information collected in respect of your identity and contact details as part of a Promotion or otherwise in the course of your use of the Allmetalika portal shall be subject to Allmetalika&rsquo;s Privacy Policy.</li>\r\n	<li>We may communicate with you by e-mail, SMS, phone call or by posting notices on the website or by any other mode of communication. For contractual purposes, you consent to receive communications (including transactional, promotional and/or commercial messages), from us with respect to your use of the portal and/or your intention to install/use our mobile based applications.</li>\r\n	<li>Allmetalika may, at its sole and absolute discretion, disqualify any user from a Promotion if such user engages in or it is found that such user has engaged in any illegal, unlawful or improper conduct (with regard to any of the Promotions or otherwise).</li>\r\n	<li>The decision of Allmetalika will be final and binding with respect to the Promotions, and the awards therein and no correspondence, objection, complaints, etc. will be entertained in this regard.</li>\r\n	<li>Each Promotion cannot be clubbed with any of other offer/promotion that are running simultaneously and organised or conducted by Allmetalika.</li>\r\n	<li>Allmetalika reserves the right to change/modify/or withdraw any of the Promotions and/or change these Terms and Conditions and/or the Promotion Terms without any prior notice of the same at its sole discretion.</li>\r\n	<li>Allmetalika does not make any commitment, express or implied, to respond to any feedback, suggestion and, or, queries of the participants of the Promotions.</li>\r\n	<li>Notwithstanding anything contained herein, the aggregate liability of Allmetalika to a participating user in relation to any Promotion for any reason whatsoever shall not exceed Rs. 50.</li>\r\n	<li>The Promotions shall be governed by the laws of the Republic of India, and any disputes or disagreements in respect of this Promotion shall be subject to the exclusive jurisdiction of the courts of Mumbai.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The Contact person shall be</p>\r\n\r\n<p>Name: Yash Jain</p>\r\n\r\n<p>Email:care@allmetallika.com</p>\r\n\r\n<p>Phone :9820600022</p>\r\n\r\n<p>Address:14/13, Jai Pushpa Milan Coop Hsg Society Sant Ramdas Road, Mulund East Mumbai, Maharahtra, India - 400081</p>\r\n\r\n<ol>\r\n	<li>TheseTerms and Conditions and Privacy Policy on the portal are published in compliance with the Information Technology (Intermediary Guidelines) Rules, 2011 that requires the same to be published on the website.</li>\r\n	<li>Further this document is an electronic record generated by computer system and does not need physical or digital signature<a name=\"_GoBack\"></a>(s).</li>\r\n</ol>\r\n', '30-05-2022', '24-08-2022');
