(4, 'privacyPolicy', 'Privacy Policy', '<p>Allmetalika is an online site/application (web and mobile based), operated by &lsquo;Allmetalika Global Private Limited&rsquo;, to bring all buyers and sellers on platform for facilitating all India sales and supplies of all types of aluminium products (hereinafter referred to as &lsquo;us&rsquo;, &lsquo;we&rsquo;, &lsquo;our&rsquo;). The portal provides E-Commerce platform as well as lead generation and vendor development for sellers and buyers dealing in or looking to sell or purchase Aluminium products through web based applications, mobile applications.&nbsp;</p>\r\n\r\n<p>We at Allmetalika believe that every person must be made aware of the company policies and create strong relationship with our users. We value that you put your trust in us when you use the Allmetalika Website or web based application or mobile application. Therefore, it becomes pertinent for us that we make necessary disclosures to you.</p>\r\n\r\n<p>Any person for any purpose or otherwise accessing, using, visiting, browsing, viewing, downloading from, &nbsp;uploading to, utilizing, the Allmetalika Website or web based application or mobile application or any feature or component or part or page or section of these by whatever name called shall be bound by this privacy policy</p>\r\n\r\n<p>By choosing to access, use, visit, browse, download from, upload to, utilize the Allmetalika Website or web based application or mobile application or any feature or component or part or page or section of these by whatever name called, you agree that you have read this privacy policy and expressly agree with whatever is stated therein. If you do not agree with whatever is stated herein in this privacy policy or terms &amp; conditions, you may choose to leave. However, if you continue to access, use, visit, browse, download from, upload to, utilizing (hereinafter referred to as &lsquo;use&rsquo; or &lsquo;using&rsquo;) the Allmetalika Website or web based application or mobile application or any feature or component or part or page or section of these by whatever name called (hereinafter referred to as &lsquo;site&rsquo;,), you are required to give your express consent and acceptance to the Privacy Policy and terms and conditions. By choosing the &lsquo;I Agree&rsquo; option on the Home Page, you will have given express consent to the Privacy Policy and Terms Conditions.</p>\r\n\r\n<p>We retain the right to modify this Privacy policy without any previous notice, The Privacy Policy with the changes shall be placed on the website for you reference. You may review the same at your end. Wherever and whenever possible by the Allmetalika it will send you a mail regarding change in the policy<br />\r\nWhat does this policy contain? This policy amongst other things deals with&nbsp;</p>\r\n\r\n<p>1) &nbsp;What is the information collected by us?&nbsp;<br />\r\n2) &nbsp;Why is information collected by us and what manner the information is collected?.&nbsp;<br />\r\n3) &nbsp;How is the information collected?&nbsp;<br />\r\n4) &nbsp;Other disclosures as deemed necessary by us and required by the applicable law in force.<br />\r\nThe information collected by us is the voluntary information provided by you. Such information is collected to provide better services to you, to provide you with a unique user experience on our portals. Also we may collect certain information when you use the site. We require this information to distinguish you from other users. Besides the voluntary information given by you we may collect information that is automatically tracked when you use the site. &nbsp;</p>\r\n\r\n<p>Allmetalika requires you to provide the personal details such as name, userid, password, email, location, etc. In order to verify your identity you may also be required to provide Permanent Alternate Number, GST Registration Certificate, Incorporation or Charter Documents. We may also require you to provide us sensitive personal information such your bank details or credit card details or other financial details so that us or users can transfer the amount(s) to your account, if any payable to you by us or by any other person. If you choose to post messages on our message boards, chat rooms or other message areas or leave feedback, we will collect that information you provide. We retain this information as necessary to provide customer support, troubleshoot problems and may also endeavour to resolve disputes, as permitted by law.</p>\r\n\r\n<p>Anyone using the Site from outside of territory of India should be aware that personal information collected on the Site may be stored and processed in which we or our affiliates, subsidiaries or agents maintain facilities, and by using the Site, you consent to any such transfer of information outside of your country.</p>\r\n\r\n<p>When you use the site, certain limited information such as but not limited to IP addresses, your behaviour on the site, your connection to internet, other non personal information such pages viewed, time spent our Site, and the websites visited just before and just after our Site may be gathered and stored by our service providers or others. We may also use log files on the server side. The data held in log files includes your IP (Internet Protocol) address, browser type, e-mail application, Internet service provider, referring/exit Web pages, computer platform type, date/time stamp, and user activity (e.g., feature usage, user rankings, statistics) These information may be used by us and third party service providers for the purpose of analytics, market research, for purpose of gathering data, storing, improving the services, analyse trends, administer the services etc. If you are using the mobile based application in that case we may also use and collect data related to (i) mobile device type and device properties; (ii) mobile device software platform and firmware; (iii) mobile phone carrier; (iv) geographical data; (v) other non-personal data</p>\r\n\r\n<p>In addition, the software enabling the Site may have associated log and temporary files that are stored on our servers or third party servers. These files store your account information, preference settings, system notifications as well as other data necessary to enable you to participate on the Site. Your information may also exist within regularly performed server backups. The foregoing information is collected on an aggregated and anonymous basis.&nbsp;</p>\r\n\r\n<p>We also use cookies or other similar tools to improve the effectives, usability of the user. These helps to collect data which is unique to the user. However, by doing so we do not receive who the user is unless user provides personal information. &quot;Cookies&quot; are small files placed on your hard drive that assist us in providing our services. We offer certain features that are only available through the use of a &quot;cookie&quot;. We also use cookies to allow you to enter your password less frequently during a session. Cookies can also help us provide information that is targeted to your interests. You have the option to decline cookies in your browser setting. The cookies do not read or access any data on the user&rsquo;s hard drives. You can also delete any cookies downloaded or installed in your browser. You may encounter &quot;cookies&quot; or other similar devices on certain pages of the Website that are placed by third parties. We do not control the use of cookies by third parties&nbsp;</p>\r\n\r\n<p>The information shared by you may also be used in for the purpose of sending emails, promotional offers, messages, and any other communication. The information provided by you shall be used for informing you about the other service provided by us.&nbsp;</p>\r\n\r\n<p>We hereby inform you that in order to provide services to you and to carry out functions we utilize third party service providers. We are required to share the information provided by you or collected from you to these service providers for the reasons as set out before. We may share the information provided by you or collected from you to ensure the safety and security of our own databases, networks, softwares, servers, computers and also to protect our rights and interests or that of the third parties whose services we avail. We use 256 bit encryption to secure all our data.</p>\r\n\r\n<p>Further we may be required to share the information provided by you or collected from you to the Government agencies mandated under the law to obtain information including sensitive personal data or information for the purpose of verification of identity, or for prevention, detection, investigation including cyber incidents, prosecution, and punishment of offences. Also, any information provided by you or collected from you including sensitive personal data or information including any information may be shared with third party by an order under law or for the time being in force.</p>\r\n\r\n<p>We further inform you that there is always a possibility of change in ownership, business decisions, or that we may acquire additional businesses or increase or improve the services provided or otherwise we may be required to transfer the information provided by you or collected from you including sensitive personal data or information including any information, to any other body corporate or a person in India, or located in any other country, we will try to ensure that same level of data protection is adhered to. However, we cannot guarantee the same.</p>\r\n\r\n<p>The site may contain links to other third party sites. We do not have control over these. They may have their own policies. You are requested to review their privacy policies. We also take no responsibility for the practices of third party sites. We disclaim any representations or warranties expressed on any other site.&nbsp;</p>\r\n\r\n<p>All information collected from you is stored securely on third party servers. We exercise limited control over such database. There are security measures in place such as firewalls, 256 bit encryption. The access to this information is password protected and the physical access is limited to employees of third party service providers. The third party service providers do not have further rights to use information provided by your for their own promotional purposes&nbsp;</p>\r\n\r\n<p>We have employed generally accepted industry standard to protect the information provided by you once we receive it. We strive to protect your information but no system or process or mode of transmission or storage or internet or device is 100% secure. Further any information posted by you on the discussion boards, comments section will be visible to others. &nbsp;We do not accept the responsibility for any loss or harm caused to you for whatever reasons. Several other websites, emails, blogs, links, etc may be received by you as if it were supposed to be sent by us or associated with us. We are not responsible for any such communication and how you deal with. We take no liability for the same and any thing or happening that follows after you access, view such communication and/or provide to information in response in including any sensitive information. For your own protection we request you do not respond to any such communication.</p>\r\n\r\n<p>Besides we have also no control over the security measures employed from the user&rsquo;s end. We have no way of verifying that users or whether the information is provided from a secured environment. Your information may be at risk from your end or the user&rsquo;s, we are not responsible for any risks amongst other things associated or arising from the user&rsquo;s end.&nbsp;</p>\r\n\r\n<p>We do not warrant that any site, mails, blogs, server, transmission are virus free. We will not be liable for any damages of any kind arising from the use of this site, including, but not limited to compensatory, direct, indirect, incidental, punitive, special and consequential damages, loss of data, goodwill, business opportunity, income or profit, loss of or damage to property and claims of third parties. In no event will we be liable for any damages or compensation whatsoever in an amount in excess of an amount of Indian Rupees 100 in total for claims of whatever nature and amount.&nbsp;</p>\r\n\r\n<p>We can never verify that the information provided by the user belongs to the user. If your information has changed or if you no longer desire our service, you may correct, update or delete it by making a request to us.<br />\r\nBy using the Website and/ or by providing your information, you consent to the collection and use of the information you disclose on the Website in accordance with this Privacy Policy, including but not limited to your consent for sharing your information as per this privacy policy.<br />\r\nIf we decide to change our privacy policy, we will post those changes on this page so that you are always aware of what information we collect, how we use it, and under what circumstances we disclose it.<br />\r\nIn accordance with Information Technology Act 2000 and rules made there under, the name and contact details of the Grievance Officer are provided below:</p>\r\n\r\n<p>Name: Yash Jain<br />\r\nEmail: care@allmetallika.com<br />\r\nPhone: 9820600022<br />\r\nAddress: 14/13, Jai Pushpa Milan Coop Hsg Society Sant Ramdas Road, Mulund East, Mumbai, Maharashtra, India &ndash; 400 080.</p>\r\n', '30-05-2022', '12-08-2022'),
(5, 'disclaimer', 'Disclaimer', '<p>Allmetalika.com (hereinafter referred to as &lsquo;Allmetalika&rsquo;) is an E-Commerce platform as well as for lead generation and vendor development for sellers and buyers dealing in or looking to sell or purchase Aluminium products. Allmetalika is an online site/application (web and mobile based), to bring all buyers and sellers on platform for facilitating all India sales and supplies of all types of aluminium products. The purpose of Allmetalika is to bring all sellers, traders, stockists, manufacturers, consignment agents, importers and fabricators online for supplying material for all India enquiries. However, we are not endorsing any of the organizations, sellers, traders, stockists, manufacturers, consignment agents, importers. We have no control whatsoever on any of the parties using the website/application. When you initiate any query or response whether or not leading to a completed sale or purchase, you do so at your own responsibility as to cost and consequences. We further expressly disclaim any warranties or representations (express or implied) in respect of quality, suitability, accuracy, reliability, completeness, timeliness, performance, safety, merchantability, fitness for any product or its purpose, or legality of the deals transacted or the content posted on the website or application by any party. While we have taken precautions to avoid inaccuracies in content, this portal, all content, information (including the price of products), software, products, services and related graphics are provided as is, without warranty of any kind. At no time shall Allmetalika or person related or affiliated to it shall have any obligations or liabilities in respect of any transactions on or through the website or application.</p>\r\n', '30-05-2022', '12-08-2022'),
(6, 'refundPolicy ', 'refund policy', '<p>When you opt to create an account the on portal, you need make subscription payments (for Sellers) or Service Charges (for Buyers when they want to confirm the order) for the same. Amounts once paid are not refundable.<br />\r\nWe reserve the right to change our fees or billing methods at any time. You are responsible for reviewing the Portal Service to obtain timely notice of such changes. Your use of the Portal means that you accept such changes. If any change is unacceptable to you, you may cancel your account at any time, but Allmetalika will not refund any subscription fees that may have accrued to your Account before cancellation of your subscription. If your use of portal service is subject to chargeability of taxes, then we may charge you for any such taxes either from prospective or retrospective effect (as the case may be), in addition to the other fees.<br />\r\nYou have the right to cancel your Account. If you do not agree to the terms in this Terms &amp; conditions of Service, your sole remedy is to not use Portal and to cancel your account. You understand and agree that the cancellation of your Account shall not entitle us to refund any amounts to you and the amount or type of fees, surcharges, applicable taxes, billing methods, or any change to the fees, applicable taxes, surcharges or billing methods for Portal Services and/or any Content or Entitlements thereon shall be non &ndash; refundable. You are also responsible for any amounts owed to other users or third-party vendors or content providers before your cancellation. Any delinquent or unpaid fees and other unresolved issues with us must be settled within 24 hours<br />\r\nIn response to a violation of these Terms &amp; Condition or any other rules, policies applicable, we may issue you a warning, suspend your Account, selectively remove, revoke or garnish entitlements at an Account and/or device level, immediately terminate any and all Accounts that you have established and/or temporarily or permanently ban your device and/or machine from accessing portal or certain Services, no refund will be granted, no entitlements will be credited to you or converted to cash or other forms of reimbursement, and you will have no further access to your Account or entitlements associated with your Account.<br />\r\nPlease note that this refund policy is only in respect of the amounts collected by us from the users. We have no responsibility or liability whatsoever in respect of Refund payable or claimed of any amount or any other transaction of similar nature entered into between users.</p>\r\n', '30-05-2022', '12-08-2022'),
(7, 'buyerterm', 'Buyer- terms and conditions', '<p>PLEASE READ THESE TERMS CAREFULLY</p>\r\n\r\n<p>This agreement is a legal agreement between you (Buyer or you) and Allmetalika Global Private Limited (hereinafter referred to as &lsquo;ALLMETALIKA&rsquo; or &lsquo;Us&rsquo; or &lsquo;We&rsquo;) incorporated and registered in India. The terms of this agreement are in addition to the other Terms and Policies on the website and mobile application.</p>\r\n\r\n<p>1) INTERPRETATION<br />\r\n1.1 The definitions and rules of interpretation in this clause apply in this agreement.<br />\r\nAuthorised Users: those individuals authorised to use the Services and the Documentation.<br />\r\nUser/Buyer Data: the data inputted by the Buyer, Authorised Users, or the ALLMETALIKA on the Buyer&rsquo;s/Buyer&rsquo;s/Buyer&#39;s/User&rsquo;s behalf for the purpose of using the Services or facilitating the use of the Services.<br />\r\nDocumentation: the documentation made available to the Buyer on the Website<br />\r\nEffective Date: the date of this agreement.<br />\r\nServices: the services, in respect of the Buyer&rsquo;s on the Website and Mobile Application shall, provided by the ALLMETALIKA to the Buyer&rsquo;s under this agreement via the Website as more particularly described in the Documentation.<br />\r\nSoftware: the online software application provided by the ALLMETALIKA on the Website and Mobile Application as the Services.<br />\r\nService Fees: the Fees payable by the Buyer to the ALLMETALIKA for the confirming of Bids received from Sellers against the requirement posted by it.<br />\r\nVirus: anything or device (including any software, code, file or programme) which may: prevent, impair or otherwise adversely affect the operation of any computer software, hardware or network, any telecommunications service, equipment or network or any other service or device; prevent, impair or otherwise adversely affect access to or the operation of any programme or data, including the reliability of any programme or data (whether by re-arranging, altering or erasing the programme or data in whole or part or otherwise); or adversely affect the user experience, including worms, trojan horses, viruses and other similar things or devices.<br />\r\nWebsite: our website at https://www.allmetalika.com<br />\r\n1.2 Clause and paragraph headings shall not affect the interpretation of this agreement.<br />\r\n1.3 A person includes an individual, corporate or unincorporated body (whether or not having separate legal personality).<br />\r\n1.4 A reference to a company shall include any company, corporation or other body corporate, wherever and however incorporated or established.1.5 Unless the context otherwise requires, words in the singular shall include the plural and in the plural shall include the singular.<br />\r\n1.6 A reference to a statute or statutory provision is a reference to it as it is in force as at the date of this agreement.<br />\r\nThis clause sets out the meaning of certain words and terms used in the rest of the agreement.</p>\r\n\r\n<p>2) BUYER&rsquo;S REGISTRATION<br />\r\n2.1 Buyer Registration on Website or mobile application is free and subject to complying with the terms of this agreement and the Terms and Policies elsewhere on the Website and Mobile Application, ALLMETALIKA hereby grants to the Buyer a non-exclusive, non-transferable right to permit the Authorised Buyers to use the Services. Authorised Buyer&rsquo; may use the Services to post its requirement, view the bids, select the bid, confirm the order, get assistance in documentation and obtaining Seller details and complete the Purchase.<br />\r\n2.2 In relation to the Authorised Buyers, the Buyer undertakes that:<br />\r\na) that it shall only create one account per entity/person;<br />\r\nb) it will not allow or suffer any account to be used by more than one individual Authorised Buyer. and&nbsp;<br />\r\nc) each Authorised User shall keep a secure password for their use of the Services, that such password shall be changed no less frequently than monthly and that each Authorised User shall keep their password confidential.<br />\r\nOnly authorised persons (the specific people you have paid for) can use the service and you won&rsquo;t let anyone else access your account.<br />\r\n2.3 The Buyer shall not:<br />\r\na) except as may be allowed by any applicable law which is incapable of exclusion by agreement between the parties:<br />\r\ni) and except to the extent expressly permitted under this agreement, attempt to copy, modify, duplicate, create derivative works from, frame, mirror, republish, download, display, transmit, or distribute all or any portion of the Software and/or Documentation (as applicable) in any form or media or by any means; or<br />\r\nii) attempt to reverse compile, disassemble, reverse engineer or otherwise reduce to human-perceivable form all or any part of the Software; or<br />\r\nb) access all or any part of the Services and Documentation in order to build a product or service which competes with the Services and/or the Documentation; or<br />\r\nc) license, sell, rent, lease, transfer, assign, distribute, display, disclose, or otherwise commercially exploit, or otherwise make the Services and/or Documentation available to any third party except the Authorised Users; or<br />\r\nd)attempt to obtain, or assist third parties in obtaining, access to the Services and/or Documentation, other than as provided under this clause 2.<br />\r\n&nbsp;You won&#39;t try to access the source code or recreate our service.<br />\r\n2.4 The Buyer shall use best endeavours to prevent any unauthorised access to, or use of, the Services and/or the Documentation and, in the event of any such unauthorised access or use, promptly notify the ALLMETALIKA, if you think anyone else has accessed your account you will tell us straight away.</p>\r\n\r\n<p>3) TERMS FOR BUYERS<br />\r\n3.1 Account : Buyers can create an account on the website by filling in details required by us and accepting the terms herein and elsewhere on the Website or Mobile Application. This account shall be accessible by website and/or mobile application.<br />\r\n3.2 After validly logging into the Buyer&rsquo;s Account, Buyer can check and/or edit its details like Business name, Personnel&rsquo;s name address, along with their Godown or Branch address, Phone number, Mobile number, email id and GST. These details shall be shared with the Seller when the Buyer Accepts the Bids for any requirement listed by it.&nbsp;<br />\r\n3.3 After logging in the account on the website or mobile application, the Buyer can visit the Order section to list requirements that can be viewed by all Sellers with active subscription. Buyer can post requirements in terms of the alloy, temper, standards, thickness, length, width, packing requirements, total requirement in KGS or pieces, delivery location, company make and other specifications and terms.<br />\r\n3.4 The Buyer can view all the bids posted by the prospective Sellers. The Sellers in response to the Buyer&rsquo;s requirement may submit its Bid (of products available with it) with details of with details of price (price quoted is exclusive of CGST including door delivery transportation), delivery period, make of products, quantity, price validity, any other of its terms or any other details as required by the Buyer, etc.<br />\r\n3.6 &nbsp;On selecting one of the competitive bids, the Buyer shall pay Service Charges of 0.25 paise per One kilogram of Aluminium to the Allmetalika, inorder to confirm the order. After payment of service charges to Allmetallika, system generated order confirmation form will be shared with Buyer and Seller. On receipt of Order Confirmstion, the buyer shall make 20% advance payment to the seller directly through NEFT/RTGS.<br />\r\n3.7 On receipt of the 20% advance payment, the Seller shall arrange for the dispatch of goods, make final tax invoice, upload the same on system as well as email it to the buyer. (Allmetalika is not liable or responsible for any terms agreed upon or not agreed upon between the parties and/or breach of terms by either party)<br />\r\n3.8 Thereafter Buyer makes the balance 80% payment against tax invoice and uploads the UTR number and payment details on the system, then seller shall dispatch the goods and provide the details of &lsquo;E-way Bill, Truck number, Lorry Receipt, details of the transporter, delivery challan, Mill Test Certificate of Manufacturer, Packing List and upload these on the system and through email to the buyer.<br />\r\n3.9 The Sale is completed once goods are delivered at agreed location and buyer issues Goods Receipt Note (GRN) or gives confirmation on the website or mobile application.<br />\r\n3.10 The order, price or terms cannot not be changed or cancelled once the buyer has accepted the same. &nbsp;<br />\r\n3.11 All Buying requirements on the Website or Mobile Application are a firm commitment to Buy. You are obligated to complete the transaction with the Seller<br />\r\n3.12 The Seller shall be responsible for the overall quality and quantity of the products and Buyer is liable to review the terms of the Seller and for the payment to be made or already made. At no time, ALLMETALIKA takes title or ownership of any product or inventory.<br />\r\n3.15 The requirement of the item must not be misleading and must describe actual need of the product. We strongly advise you not to test the site with false purchases, as it will put you at substantial personal legal risk. It is an offence to use a false name or any other false personal information<br />\r\n3.16 Buyers enquiry will be live on application for a maximum period of seven working days, after which it will be deleted automatically from the bidding system of Seller<br />\r\n3.17 It is pertinent to mention here that, ALLMETALIKA itself does not own/regulate the Subscribed Sellers or other buyers and neither does there exist any employer/employee relation between them. It is the Seller who shall render the required product to you as per the relevant information submitted on the Website or mobile application.</p>\r\n\r\n<p>4) ACCESS TO SERVICES<br />\r\n&nbsp;4.1 The ALLMETALIKA shall, during the Term, provide the Services to the Buyer on and subject to the terms of this agreement.&nbsp;<br />\r\n4.2The ALLMETALIKA shall use commercially reasonable endeavours to make the Services available 24 hours a day, seven days a week, except for:<br />\r\na) planned maintenance carried out during the maintenance window<br />\r\nb) unscheduled maintenance provided that the ALLMETALIKA has used reasonable endeavours to give the Buyer notice in advance.<br />\r\nWe do our best to make sure you can access the service but there will be some occasions when it will be down (bug fixes, patches, updates etc.)</p>\r\n\r\n<p>5) BUYER DATA<br />\r\n5.1 The Buyer shall own all right, title and interest in and to all of the Buyer Data and shall have sole responsibility for the legality, reliability, integrity, accuracy and quality of the Buyer Data.<br />\r\n5.2 The ALLMETALIKA is not under any obligation to store any Buyer Data. The ALLMETALIKA shall not be responsible for any loss, destruction or alteration of Buyer Data.<br />\r\n&nbsp;5.3 If the ALLMETALIKA processes any personal data on the Buyer&#39;s behalf when performing its obligations under this agreement, the parties record their intention that the Buyer shall be the data controller and the ALLMETALIKA shall be a data processor and in any such case:<br />\r\na) the Buyer acknowledges and agrees that the personal data may be transferred or stored outside the India or the country where the Buyer and the Authorised Users are located in order to carry out the Services and the ALLMETALIKA&#39;s other obligations under this agreement;<br />\r\nb) the Buyer shall ensure that the Buyer is entitled to transfer the relevant data (whether personal or not) to the ALLMETALIKA so that the ALLMETALIKA may lawfully use, process and transfer the data in accordance with this agreement on the Buyer&#39;s behalf;<br />\r\nc) the Buyer shall ensure that the relevant third parties have been informed of, and have given their consent to, such use, processing, and transfer as required by all applicable data protection legislation;<br />\r\nd) each party shall take appropriate technical and organisational measures against unauthorised or unlawful processing of the data or its accidental loss, destruction or damage.&nbsp;Any information you put into our site belongs to you and not us<br />\r\nThe data will travel through our servers to be processed and this means it could be processed by a server outside India. You are responsible for any Data Protection rules that apply to any content you upload.</p>\r\n\r\n<p>6) ALLMETALIKA&#39;S OBLIGATIONS<br />\r\n&nbsp;6.1 The ALLMETALIKA undertakes that the Services will be performed substantially in accordance with the Documentation and with reasonable skill and care.<br />\r\n6.2 The ALLMETALIKA:<br />\r\na) does not warrant that the Buyer&#39;s use of the Services will be uninterrupted or error-free; or that the Services, Documentation and/or the information obtained by the Buyer through the Services will meet the Buyer&#39;s requirements; and<br />\r\nb) is not responsible for any delays, delivery failures, or any other loss or damage resulting from the transfer of data over communications networks and facilities, including the internet, and the Buyer acknowledges that the Services and Documentation may be subject to limitations, delays and other problems inherent in the use of such communications facilities.<br />\r\n&nbsp;We do our best to make sure our service does what it should, but we do not guarantee it.</p>\r\n\r\n<p>7) CHARGES AND PAYMENT<br />\r\n7.1 The Buyer shall pay the Service Charges to the ALLMETALIKA for confirming every single BID in accordance with this clause 7.<br />\r\n7.2 The Buyer shall pay the Service Charge to the ALLMETALIKA for the confirming the BID and accepting the terms of the Seller; or<br />\r\n7.3 The Buyer shall pay the Service Charge by debit or credit card or online banking or UTI through the Website or Mobile Application. The ALLMETALIKA uses the third party payment processors or gateways for payments. The ALLMETALIKA does not store or process any card details on its own servers.Processor or Gateway will store the card details used to pay the Service charges<br />\r\n7.4 All amounts and fees stated or referred to in this agreement:<br />\r\na) shall be payable in Indian Rupees;<br />\r\nb) are, subject to clause 10.4(b), non-cancellable and non-refundable;<br />\r\nc) are exclusive of any applicable taxes (such as GST), which shall be added to the ALLMETALIKA&#39;s invoice(s) at the appropriate rate.<br />\r\n7.5 ALLMETALIKA shall be entitled to increase the Service Charges without prior intimation. Service charges need to be paid via website</p>\r\n\r\n<p>8) PROPRIETARY RIGHTS<br />\r\n&nbsp;8.1The Buyer acknowledges and agrees that the ALLMETALIKA and/or its licensors own all intellectual property rights in the Services. Except as expressly stated herein, this agreement does not grant the Buyer any rights to, or in, patents, copyright, database right, trade secrets, trade names, trade marks (whether registered or unregistered), or any other rights or licences in respect of the Services.<br />\r\n8.2 ALLMETALIKA confirms that it has all the rights in relation to the Services that are necessary to grant all the rights it purports to grant under, and in accordance with, the terms of this agreement. We own all intellectual property rights in our code/software/service.<br />\r\n8.3 ALLMETALIKA does not own or claim any right in any Buyer Data.</p>\r\n\r\n<p>9) INDEMNITY<br />\r\n&nbsp;You own all rights in any data you upload, we do not claim any right over it, and we just use it for the purpose of providing services. Buyer shall indemnify ALLMETALIKA, its agents, employees, directors, officers and affiliates from all refunds or warranties, claims, demands, liabilities, losses and damages (actual and consequential) of every kind and nature, known and unknown, suspected and unsuspected, disclosed and undisclosed, arising out of or in any way connected with listings or bid, accepted or unaccepted, completed or incomplete transactions, or goods offered or actually delivered.<br />\r\n9.1 The Buyer shall defend, indemnify and hold harmless the ALLMETALIKA against claims, actions, proceedings, losses, damages, expenses and costs (including without limitation court costs and reasonable legal fees) arising out of or in connection with the Buyer&#39;s use of the Services or otherwise. &nbsp;If you do anything through our website which ends up with a legal claim being made against us you will be responsible for any costs we incur as a result.</p>\r\n\r\n<p>10) LIMITATION OF LIABILITY<br />\r\n10.1 This clause 10 sets out the entire financial liability of the ALLMETALIKA (including any liability for the acts or omissions of its employees, agents and sub-contractors or any person associated with it) to the Buyer:<br />\r\na) arising under or in connection with this agreement;<br />\r\nb) in respect of any use made by the Buyer of the Services; and<br />\r\nc) in respect of any representation, statement or tortious act or omission (including negligence) arising under or in connection with this agreement.<br />\r\n10.2 Except as expressly and specifically provided in this agreement:<br />\r\na) the Buyer assumes sole responsibility for and from the use of the Services and the transactions (whether completed or not) entered into by the Buyer, and for liability or loss arising therefrom. The ALLMETALIKA shall have no liability for any damage caused by errors or omissions in any information, instructions or documentation provided to the ALLMETALIKA by the Buyer or Buyer in connection with the Services, or any actions taken by the ALLMETALIKA at the Buyer&#39;s direction or consent or due to use of services by Buyer (including partial use of any service);<br />\r\nb) all warranties, representations, conditions and all other terms of any kind whatsoever implied by statute or common law are, to the fullest extent permitted by applicable law, excluded from this agreement; and<br />\r\nc) the Services are provided to the Buyer on an &quot;as is&quot; basis.<br />\r\n10.3 ALLMETALIKA is not liable and responsible to Buyer or any other person for any action or inaction of a Buyer or any person posing to be a buyer or any other person.<br />\r\n10.4 Subject to clause 10.2 and clause 10.3:<br />\r\na) the ALLMETALIKA shall not be liable whether in tort (including for negligence or breach of statutory duty), contract, misrepresentation, restitution or otherwise for any loss of profits, loss of business, depletion of goodwill and/or similar losses or loss or corruption of data or information, or pure economic loss, or for any special, indirect or consequential loss, costs, damages, charges or expenses however arising under this agreement; and<br />\r\nb) the ALLMETALIKA&#39;s total aggregate liability in contract, tort (including negligence or breach of statutory duty), misrepresentation, restitution or otherwise, arising in connection with the performance or contemplated performance of this agreement shall be limited to only the service charges paid in respect of the order which in dispute has arisen and not all service charges paid by Buyer. We will never be liable to you for anything more than service charges in respect of the order which is under dispute.</p>\r\n\r\n<p>11) TERM AND TERMINATION<br />\r\n11.1 This agreement shall, unless otherwise terminated as provided in this clause 11, commence on the Effective Date and shall continue unless terminated, unless:<br />\r\na) either party notifies the other party of termination, in writing,<br />\r\nb) you cancel your account through our website; or<br />\r\nc) otherwise terminated in accordance with the provisions of this agreement;<br />\r\nand the Term together with any subsequent Renewal Periods shall constitute the Term.<br />\r\nThis agreement lasts for Annual period. It may renew automatically at the end of each period on receipt of payment by us of then prevailing Subscription amount or until you cancel it.<br />\r\n11.2 Without affecting any other right or remedy available to it, ALLMETALIKA may terminate this agreement with immediate effect by giving written notice to the Buyer party if:<br />\r\na) the Buyers fails to pay any amount due to any person who has also availed of or is using or has used the Services of the ALLMETALIKA;<br />\r\nb) the Buyer party commits a material breach of any term agreed with ALLMETALIKA or any person who has also availed of or is using or has used the Services of the ALLMETALIKA;<br />\r\nc) the Buyer has committed any acts which ALLMETALIKA holds to be unethical or unfair trade practice or involves moral turpitude or fraudulent or bogus and/or provided any information which is false. The decision of ALLMETALIKA in this regard shall be final.<br />\r\n11.3 On termination of this agreement for any reason:<br />\r\na) all licences granted under this agreement shall immediately terminate;<br />\r\nb) the ALLMETALIKA may destroy or otherwise dispose of any of the Buyer Data in its possession;<br />\r\nc) in case of termination under clause 11.2 c) ALLMETALIKA shall have the right to not allow such entity or person whose subscription is so terminated or any of it&rsquo;s related party to take another Subscription and/or terminate their existing subscription including displaying names of such person on the website and mobile application and reason for termination of their subscriptions; and<br />\r\nd) any rights, remedies, obligations or liabilities of the parties that have accrued up to the date of termination, including the right to claim damages in respect of any breach of the agreement which existed at or before the date of termination shall not be affected or prejudiced.</p>\r\n\r\n<p>12 FORCE MAJEURE<br />\r\n&nbsp;The ALLMETALIKA shall have no liability to the Buyer under this agreement if it is prevented from or delayed in performing its obligations under this agreement, or from carrying on its business, by acts, events, omissions or accidents beyond its reasonable control, including, without limitation, strikes, lock-outs or other industrial disputes (whether involving the workforce of the ALLMETALIKA or any other party), pandemic, failure of a utility service or transport or telecommunications network, act of God, war, riot, civil commotion, malicious damage, compliance with any law or governmental order, rule, regulation or direction, accident, breakdown of plant or machinery, fire, flood, storm or default of ALLMETALIKAs or sub-contractors or vendors<br />\r\n&nbsp;We are not responsible for anything outside our control (power cuts, natural disasters, server downtimes etc.)</p>\r\n\r\n<p>13 ASSIGNMENT<br />\r\n13.1 The ALLMETALIKA may but the Buyer may not at any time assign, transfer, charge, sub-contract or deal in any other manner with all or any of its rights or obligations under this agreement. &nbsp;You can&rsquo;t transfer your account to someone else without our agreement.</p>\r\n\r\n<p>14 INDEPENDENT PARTIES<br />\r\n&nbsp;Nothing in this agreement is intended to or shall operate to create a partnership between the parties, or authorise either party to act as agent for the other, and neither party shall have the authority to act in the name or on behalf of or otherwise to bind the other in any way (including, but not limited to, the making of any representation or warranty, the assumption of any obligation or liability and the exercise of any right or power). There is no agency, partnership, joint venture, employee-employer or franchisor-franchisee relationship between ALLMETALIKA and any User of the Platform or between ALLMETALIKA and any Buyer or Buyer on the Platform.</p>\r\n\r\n<p>15 GOVERNING LAW<br />\r\nThis agreement and any dispute or claim arising out of or in connection with it or its subject matter or formation (including non-contractual disputes or claims) shall be governed by and construed in accordance with the law of India. Each party irrevocably agrees that the courts of Mumbai, Maharashtra shall have exclusive jurisdiction to settle any dispute or claim arising out of or in connection with this agreement or its subject matter or formation (including non-contractual disputes or claims).</p>\r\n', '30-05-2022', '12-08-2022'),
(8, 'contactUs', 'Contact Us', '<p><strong>ALLMETALIKA GLOBAL PRIVATE LIMITED.</strong></p>\r\n\r\n<p>&nbsp;C-106, Sai Classic, Office Wing,Gavanpada, Mulund (E), Mumbai - 400 081, Maharashtra, India.</p>\r\n\r\n<p>Contact. : +91 982 060 0022</p>\r\n\r\n<p>Email&nbsp; &nbsp; :&nbsp;<a href=\"mailto:hello@allmetalika.com\" target=\"_blank\">hello@allmetalika.com</a></p>\r\n\r\n<p>Website :&nbsp;<a href=\"https://allmetalika.com\" target=\"_blank\">www.allmetalika.com</a></p>\r\n', NULL, '05-09-2022'),
(9, 'support', 'support', '<p>Email : care@allmetalika.com</p>\r\n\r\n<p>Customer Care Number&nbsp; +91 9820600022</p>\r\n', NULL, '15-08-2022'),
(10, 'cancellationPolicy', 'cancellation Policy', '<p>When you opt to create an account the on portal, you need make subscription payments (for Sellers) or Service Charges (for Buyers when they want to confirm the order) for the same. Amounts once paid are not refundable.<br />\r\nWe reserve the right to change our fees or billing methods at any time. You are responsible for reviewing the Portal Service to obtain timely notice of such changes. Your use of the Portal means that you accept such changes. If any change is unacceptable to you, you may cancel your account at any time, but Allmetalika will not refund any subscription fees that may have accrued to your Account before cancellation of your subscription. If your use of portal service is subject to chargeability of taxes, then we may charge you for any such taxes either from prospective or retrospective effect (as the case may be), in addition to the other fees.<br />\r\nYou have the right to cancel your Account. If you do not agree to the terms in this Terms &amp; conditions of Service, your sole remedy is to not use Portal and to cancel your account. You understand and agree that the cancellation of your Account shall not entitle us to refund any amounts to you and the amount or type of fees, surcharges, applicable taxes, billing methods, or any change to the fees, applicable taxes, surcharges or billing methods for Portal Services and/or any Content or Entitlements thereon shall be non &ndash; refundable. You are also responsible for any amounts owed to other users or third-party vendors or content providers before your cancellation. Any delinquent or unpaid fees and other unresolved issues with us must be settled within 24 hours<br />\r\nIn response to a violation of these Terms &amp; Condition or any other rules, policies applicable, we may issue you a warning, suspend your Account, selectively remove, revoke or garnish entitlements at an Account and/or device level, immediately terminate any and all Accounts that you have established and/or temporarily or permanently ban your device and/or machine from accessing portal or certain Services, no refund will be granted, no entitlements will be credited to you or converted to cash or other forms of reimbursement, and you will have no further access to your Account or entitlements associated with your Account.<br />\r\nPlease note that this refund policy is only in respect of the amounts collected by us from the users. We have no responsibility or liability whatsoever in respect of Refund payable or claimed of any amount or any other transaction of similar nature entered into between users.</p>\r\n', NULL, '15-08-2022');
