INSERT INTO `testimonials` (`id`, `person_name`, `designation`, `description`, `created_at`, `updated_at`) VALUES
(1, 'Mr. Sundaram', 'Aluminium Trader - Chennai', '<p>This is the first time in India that a mobile app is been launched only for Aluminium Products trading and bringing Buyers and Sellers- pan India on one trading platform.This will lead to more business generation and also buyers&nbsp; will have multiple choices of sellers .Seller can reach customers all across the Country....I look forward to be a part of this initiative and wish all the success.......</p>\r\n', '11-08-2022', '02-02-2023'),
(2, 'Ramesh Jain', 'Trader- Mumbai', '<p>My hearty Congrats to Team Allmetalika for launching this unique mobile application for trading of Aluminum products.This platform is really useful for prospective Buyers and Sellers to conduct business Pan India and it will create healthy competition and sustainable growth.Ramesh Jain....</p>\r\n', '11-08-2022', '15-08-2022'),
(3, 'Lalit Mehta', 'Trader - TF', '<p>I m happy to be a part of this Mobile Application for Aluminium products and this is the first time in India , that a mobile app has been developed only for Aluminum Products.I feel this is a&nbsp;great venture and wish Team Allmetalika, all the success......Lalit Mehta - TF</p>\r\n', '11-08-2022', '15-08-2022'),
(4, 'Pratik Shingare', 'Trader - Pune Maharashrta', '<p>This platform is a one-stop solution for trading needs in the aluminium industry. You will get a variety of buyers and sellers on the same portal. The process of buying and selling is completely secure for both parties. Thank you, AllMetalika team, for providing such a great online solution for the complete process.</p>\r\n', '24-08-2022', '24-08-2022');
